INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(1, 1, 1, 'Najpopularniejszy owoc egzotyczny. Chętnie spożywany przez dzieci. Może występować w kolorach od zielono-żółtego do żółtego. Te drugie najlepiej spożywać na surowo. Najsmaczniejsze, najsłodsze i najbardziej aromatyczne są banany, które posiadają brązowe plamki cukrowe na skórce - powstają w wyniku dojrzewania owocu. Takie banany najlepiej smakować będą w koktajlach i musach.', '', 'banan-wazony', '', '', '', 'Banan ważony', '', '', '', ''),
(2, 1, 1, 'papryka czerwona 100%.\n\nOznakowanie alergenów: wielkimi literami', '', 'papryka-czerwona-wazona', '', '', '', 'Papryka czerwona ważona', '', '', '', ''),
(3, 1, 1, 'Warzywo, które znalazło zwoje zastosowanie w niemal wszystkich kuchniach świata. Słodka, chrupiąca marchewka to jeden z podstawowych składników wywarów na zupę, sałatek, surówek, a także odżywczych, świeżo wyciskanych soków.', '', 'marchew-wazona', '', '', '', 'Marchew ważona', '', '', '', ''),
(4, 1, 1, 'Świeża, soczysta i aromatyczna cebula o intensywnym smaku i zapachu.', '', 'cebula-wazona', '', '', '', 'Cebula ważona', '', '', '', ''),
(5, 1, 1, 'Najpopularniejszy owoc wśród cytrusów ceniony za wspaniały aromat i niepowtarzalny, wyrazisty i orzeźwiający smak. Na ogół spożywamy je na surowo bądź wyciskamy z nich świeży sok. Są doskonałym dodatkiem do zimnych napojów i drinków, a także grzanych alkoholi: piwa i wina. Nieodzowny składnik sałatek owocowych. Mają zastosowanie również w daniach mięsnych- świetnie komponują się z kaczką.', '', 'pomarancze-wazone', '', '', '', 'Pomarańcze ważone', '', '', '', ''),
(6, 1, 1, 'Odmiana Szampion masowo uprawiana jest tylko w Polsce. Owoce są średnie lub duże kulisto-stożkowe, pomarańczowe z rozległym rumieńcem, kruche, słodko-kwaśne, soczyste, aromatyczne i bardzo smaczne. Nadają się do jedzenia bezpośrednio wkrótce po zbiorze. W Europie najsmaczniejsze są na początku zimy. Twardy miąższ i kwaskowaty smak pozwalają klasyfikować te jabłka do tych, które najlepiej sprawdzą się w obróbce termicznej czy do przygotowania przecierów, ale prawda jest taka, że Szampiony mają także liczne grono zwolenników, którzy jedzą je również na surowo. Są bardzo aromatyczne i doskonale komponują się np. w konfiturach ze smakiem słodkich gruszek.', '', 'jablka-szampion-wazone', '', '', '', 'Jabłka Szampion ważone', '', '', '', ''),
(7, 1, 1, 'Smaczne, zdrowe i lekkostrawne warzywo, które dostarcza małej ilości kalorii i ma wiele wartości odżywczych. Jego zastosowanie w kuchni jest naprawdę różnorodne - z cukinii przygotowuje się przetwory, dusi się ją, grilluje, panieruje, smaży, a nawet wykorzystuje jako bazę do słodkich wypieków. Cukinia jest krewniakiem dyni. Co ciekawe, jej nazwa oznacza w języku włoskim małą dynię (zucchina). Warzywo to została wyhodowana w słonecznej Italii już w XIX wieku i do dziś cenione jest za delikatny smak i walory dietetyczne.', '', 'cukinia-wazona', '', '', '', 'Cukinia ważona', '', '', '', ''),
(8, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-cebula-luz', '', '', '', 'BIO CEBULA LUZ', '', '', '', ''),
(9, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-marchew-luz', '', '', '', 'BIO MARCHEW LUZ', '', '', '', ''),
