(13, 1, 1, '<p>Bio jabłka 100%. Oznakowanie alergenów: wielkimi literami</p>', '', 'bio-jablka-luz', '', '', '', 'BIO JABŁKA LUZ', '', '', '', ''),
(14, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-natka-pietruszki-peczek-szt', '', '', '', 'BIO Natka pietruszki pęczek szt', '', '', '', ''),
(15, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-pietruszka-luz', '', '', '', 'BIO PIETRUSZKA LUZ', '', '', '', ''),
(16, 1, 1, 'Ziemniaki "Jakość z Natury Carrefour" są uprawiane w wyselekcjonowanych gospodarstwach zlokalizowanych w centrum Niziny Błońskiej. Doświadczenie producentów oraz biologiczne metody walki ze szkodnikami umożliwiają zredukowanie stosowania środków fitosanitarnych. Po zbiorach, ziemniaki są przechowywane w naturalnych warunkach - nie są stosowane zabiegi fitosanitarne przeciwko kiełkowaniu.', '', 'ziemniaki-do-gotowania-jakosc-z-natury-carrefour-2-kg', '', '', '', 'Ziemniaki do gotowania "Jakość z Natury Carrefour" 2 kg', '', '', '', ''),
(17, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-imbir-luz', '', '', '', 'BIO IMBIR LUZ', '', '', '', ''),
(18, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-buraki-luz', '', '', '', 'BIO BURAKI LUZ', '', '', '', ''),
(19, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-pomarancze', '', '', '', 'BIO pomarańcze', '', '', '', ''),
(20, 1, 1, 'Mandarynka to młodsza siostra pomarańczy. Jest od niej mniejsza, słodsza i bardziej aromatyczna. Charakteryzują się wysoką zawartością witaminy C i A. Nazwa jej wzięła się od nazwy wyspy Mauritius na Oceanie Indyjskim, którą niegdyś nazywano Mandarą.', '', 'mandarynki-wazone', '', '', '', 'Mandarynki ważone', '', '', '', ''),
(21, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-mango', '', '', '', 'BIO Mango', '', '', '', ''),
