(33, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-pomarancze-na-sok-luz', '', '', '', 'BIO Pomarańcze na sok luz', '', '', '', ''),
(34, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-orzech-kokosowy-szt', '', '', '', 'BIO Orzech kokosowy szt', '', '', '', ''),
(35, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'bio-kurkuma-luz', '', '', '', 'BIO KURKUMA LUZ', '', '', '', ''),
(36, 1, 1, 'ziemniaki 100%.\n\nOznakowanie alergenów: wielkimi literami', '', 'ziemniaki-wazone', '', '', '', 'Ziemniaki ważone', '', '', '', ''),
(37, 1, 1, 'Por obok czosnku i cebuli, jest jednym z najbardziej popularnych warzyw, które podkręcają smak innych potraw i nadają im wyjątkowy aromat.', '', 'por-sztuka', '', '', '', 'Por sztuka', '', '', '', ''),
(38, 1, 1, 'Popularny owoc, który pod brązową skórką pokrytą lekkim meszkiem kryje zielony, soczysty, jadalny miąższ. W smaku słodkie, z wyraźnie wyczuwalnym kwaskowatym aromatem. Można spożywać je na surowo. Doskonale nadaje się do dekoracji potraw i deserów. Dobrze sprawdzi sie również w sałatkach, nie tylko tych owocowych ale i mięsno-warzywnych.', '', 'kiwi-sztuka', '', '', '', 'Kiwi sztuka', '', '', '', ''),
(39, 1, 1, 'Słodko-kwaśna odmiana Ligol została wyhodowana w Polsce natomiast cieszy się coraz większym uznaniem w Europie. Zbiera się ją w październiku. Owoce są duże lub bardzo duże, baryłkowate, pokryte zieloną skórką z rozmytym, jasnoczerwonym paskowatym rumieńcem. Miąższ Ligola jest ścisły, jędrny, twardy, wyjątkowo smaczny i bardzo ceniony przez młodzież. Owoce są smacznie zarówno zaraz po zbiorze, jak też po nawet kilkumiesięcznym przechowywaniu. Po obraniu nie czernieje, więc doskonale nadaje się do sałatek, a ze względu na swą soczystość jest szczególnie polecane również na soki, kompoty i koktajle.', '', 'jablka-ligol-wazone', '', '', '', 'Jabłka Ligol ważone', '', '', '', ''),
(40, 1, 1, 'Zdrowe i smaczne warzywo należące do rodziny kapustnych o szerokim zastosowaniu kulinarnym. Ceniony ze względu na swoje walory dietetyczne i zdrowotne.', '', 'brokul-sztuka', '', '', '', 'Brokuł sztuka', '', '', '', ''),
(41, 1, 1, 'W naszych sklepach sprzedajemy wyłącznie awokado „ready to eat” – „gotowe do zjedzenia”, które w odróżnieniu od standardowego, poddawane jest procesowi dojrzewania w odpowiednich komorach. Dzięki temu zabiegowi, już w momencie zakupu, nadają się do spożycia. Awokado odmiany Hass jest powszechnie uważane za najlepsze awokado na rynku. Miąższ dojrzałego awokado ma mazistą konsystencję podobną do masła. To właśnie konsystencja awokado pozwala na przygotowanie z niego aromatycznej pasty. Idealnie pasuje także do sałatek lub jako dodatek do kanapek. Oprócz zastosowania w kuchni, nadaje się jako komponent maseczek do twarzy czy włosów.', '', 'awokado-hass-szt', '', '', '', 'AWOKADO HASS  SZT.', '', '', '', ''),
(42, 1, 1, 'Pietruszka to warzywo, które wraz z marchewką, selerem i porem stanowi część włoszczyzny. Ma zapach korzenny, lekko słodkawy i delikatnie cierpki. Wzbogaca smak wywarów, nadając im unikatowy smak i aromat.\nNiektórzy obierają go przed ugotowaniem. Nie jest to jednak konieczne. Skórka pietruszki także ma wyjątkowy smak i jest cennym źródłem błonnika pokarmowego.\nW korzeniu pietruszki możemy znaleźć  wiele cennych witamin i składników mineralnych (prowitaminę A, witaminę C, witaminy z grupy B, kwas foliowy, żelazo, wapń, magnez, fosfor, sód, mangan, selen i cynk), a do korzystnych właściwości tego warzywa możemy zaliczyć także działanie oczyszczające (usuwanie toksyn), regulacje procesów trawienia,  działanie moczopędne czy łagodzenie bólu menstruacyjnego (dzięki działaniu rozkurczającemu).', '', 'pietruszka-wazona', '', '', '', 'Pietruszka ważona', '', '', '', ''),
(43, 1, 1, 'Najbardziej ceniona i najchętniej kupowana odmiana pomidora, która charakteryzuje się wyjątkową słodkością i soczystością. Ich produkcja wymaga sporo pracy, ale jest ona nagradzana wysokim plonem dobrej jakości.', '', 'pomidory-malinowe-wazone', '', '', '', 'Pomidory malinowe ważone', '', '', '', ''),
(44, 1, 1, 'Gala to zimowa odmiana deserowa jabłek, która powstała poprzez skrzyżowanie odmian Golden Delicious oraz Kidd''s Orange Red. Dostępna zazwyczaj od września do stycznia. Owoce Gala są średniej lub małej wielkości, mają stożkowaty kształt, a ich skórka jest gładka i lekko błyszcząca o żółto-czerwonej barwie. Najbardziej aromatyczne są w I tygodniu po zbiorze (z wyczuwalnym aromatem wanilii). Miąższ natomiast jest kremowy, słodki, soczysty, delikatny, kruchy i chrupiący. Jabłka Gala to typ ogólnoużytkowy – nadają się do wszystkiego. Świetnie smakują na surowo, ale polecany jest także do ciast, przetworów, sałatek czy do suszenia.', '', 'jablka-gala-wazone', '', '', '', 'Jabłka ''Gala'' ważone', '', '', '', ''),
(45, 1, 1, 'Seler to podstawowy składników włoszczyzny niezbędny do przygotowania aromatycznych wywarów warzywnych lub warzywno-mięsnych. Oprócz specyficznego smaku posiada także ogromne wartości odżywcze. Seler jest jednym z najstarszych warzyw świata, które dotarło do Polski w XVI wieku za sprawą pochodzącej z Włoch Królowej Bony (stąd też nazywany jest, wraz z kilkoma innymi warzywami, „włoszczyzną”).', '', 'seler-wazony', '', '', '', 'Seler ważony', '', '', '', ''),
(46, 1, 1, 'Koper to roślina, która znalazła szerokie zastawanie w kuchni, a w naszej polskiej tradycji kulinarnej koperek dodaje się zazwyczaj do młodych ziemniaków, mizerii lub do kiszenia ogórków. Koper nadaje charakterystyczny smak i aromat przyrządzanym przez nas potrawom, a także podkręca ich wygląd końcowy. Koperek świetnie komponuje się z sosami sałatkowymi na bazie jogurtu lub śmietany, z daniami rybnymi z pstrąga lub łososia lub stanowi dodatek do zup.', '', 'koperek-peczek', '', '', '', 'KOPEREK PĘCZEK', '', '', '', ''),
(47, 1, 1, 'Cytryny warto jeść cały rok, w dowolnej postaci - można wycisną z nich sok i pić w formie lemoniady na zimno (tylko woda z cytryną i miętą) oraz na ciepło (ciepła woda, cytryna, miód i imbir), a także robić sorbety cytrynowe z niewielkim dodatkiem miodu.', '', 'cytryny-05-kg', '', '', '', 'Cytryny 0,5 kg', '', '', '', ''),
(48, 1, 1, 'Cebula dymka to mała, młoda cebula ze szczypiorkiem o szerokim zastosowaniu kulinarym. Posiada łagodniejszy i słodszy smak - stanowi alternatywę dla klasycznej cebuli w różnych daniach i przekąskach. Cebula dymka może urozmaicić wiele naszych dań - a co najważniejsze, nie uronimy przy niż żadnej łzy.', '', 'cebula-dymka-peczek', '', '', '', 'CEBULA DYMKA PĘCZEK', '', '', '', ''),
(49, 1, 1, 'papryka żółta 100%.\n\nOznakowanie alergenów: wielkimi literami', '', 'papryka-zolta-wazona', '', '', '', 'Papryka żółta ważona', '', '', '', ''),
(50, 1, 1, 'cebula czerwona 100%.\n\nOznakowanie alergenów: wielkimi literami', '', 'cebula-czerwona-wazona', '', '', '', 'Cebula czerwona ważona', '', '', '', ''),
(51, 1, 1, 'Świeża sałata to idealny dodatek do kanapek i wiosennych sałatek.', '', 'salata-sztuka', '', '', '', 'Sałata sztuka', '', '', '', ''),
(52, 1, 1, 'Carrefour\n    \n\n        Pomidor malinowy, klasa I, typ: okrągły.Kal. 57-67 mm}\n    \n\nProdukt polski\njakość kontrolowana\n\n\n        Pomidor malinowy.', '', 'carrefour-targ-swiezosci-pomidor-malinowy-500-g', '', '', '', 'Carrefour Targ Świeżości Pomidor malinowy 500 g', '', '', '', ''),
(53, 1, 1, 'Kalafior to warzywo, którego wartość odżywczą i właściwości powinien docenić każdy z nas. Charakteryzuje się m.in. niską kalorycznością, z tego powodu polecany jest osobą będącym na diecie.', '', 'kalafior-sztuka', '', '', '', 'Kalafior sztuka', '', '', '', ''),
(54, 1, 1, 'Najpopularniejszy owoc wśród cytrusów ceniony za wspaniały aromat i niepowtarzalny, wyrazisty i orzeźwiający smak. Na ogół spożywamy je na surowo bądź wyciskamy z nich świeży sok. Są doskonałym dodatkiem do zimnych napojów i drinków, a także grzanych alkoholi: piwa i wina. Nieodzowny składnik sałatek owocowych. Mają zastosowanie również w daniach mięsnych- świetnie komponują się z kaczką.', '', 'pomarancze-siatka-1-kg', '', '', '', 'POMARAŃCZE SIATKA 1 KG', '', '', '', ''),
(55, 1, 1, '- smaczne odmiany typu C "mączyste" - uprawiane w wybranych gospodarstwach Niziny Błońskiej - bezpieczne dzięki kontroli jakości "od pola do talerza"', '', 'ziemniaki-do-smazenia-i-pieczenia-jakosc-z-natury-carrefour-2-kg', '', '', '', 'Ziemniaki do smażenia i pieczenia "Jakość z Natury Carrefour" 2 kg', '', '', '', ''),
(56, 1, 1, 'Ogórki użyte do produkcji pochodzą z certyfikowanych upraw ekologicznych. Kupujemy je wyłącznie od dostawców, do których mamy zaufanie. Nasze ogórki kiszone produkujemy według tradycyjnej receptury, co gwarantuje ich najwyższą jakość. Ogórków nie pasteryzujemy. Produkt nie zawiera żadnych konserwantów, regulatorów kwasowości ani przeciwutleniaczy. Każda torebka wyposażona jest w mechanizm, pozwalający na jej wielokrotne otwieranie i zamykanie.', '', 'charsznickie-ogorki-kiszone-500-g', '', '', '', 'Charsznickie ogórki kiszone 500 g', '', '', '', ''),
(57, 1, 1, 'Słodka odmiana ziemniaka o o niepowtarzalnych walorach kulinarnych. Stanowią alternatywę dla klasycznego i lubianego smaku ziemniaka. Pochodzą z Ameryki Południowej i Środkowej.', '', 'ziemniak-slodki-batat-wazony', '', '', '', 'Ziemniak słodki batat ważony', '', '', '', ''),
(58, 1, 1, 'Wyjątkowo słodka odmiana pomidora cherry o drobnych, soczystych i nieco wydłużonych owocach. Małe pomidorki daktylowe sprawdzą się idealnie jako dodatek do sałatek, tart, przekąsek lub jako subtelna ozdoba talerza.', '', 'pomidor-daktylowy-250-g', '', '', '', 'POMIDOR DAKTYLOWY 250 g', '', '', '', ''),
(59, 1, 1, 'Limonka jest mniejszą siostrą cytryny. Orzeźwiająca, soczysta, o nieco intensywniejszym aromacie niż jej żółta odpowiedniczka. Limonka jest na ogół okrągła, w kolorach od intensywnie zielonego do zielono-żółtego. Niezastąpiony składnik drinków, w tym popularnego mojito. Często stosowana jest w daniach kuchni tajskiej a także jako dodatek do sosów i dresingów.', '', 'limonka-sztuka', '', '', '', 'LIMONKA SZTUKA', '', '', '', ''),
(60, 1, 1, 'Produkt polski', '', 'czosnek', '', '', '', 'Czosnek', '', '', '', ''),
(61, 1, 1, 'Soczysty owoc o bardzo aromatycznym, słodkim smaku. Skórka jest cienka i gładka, ale twarda - dlatego pomimo iż jest jadalna, usuwa się ją przed spożyciem. Miąższ ma barwę pomarańczowo-żółtą. W środku owocu znajduje się pestka. W naszych sklepach sprzedajemy wyłącznie wyselekcjonowane, dojrzałe odmiany mango. Zawiera witaminy z grupy B, witaminy A, C, E, K oraz mikroelementy takie jak żelazo, magnez, wapń, potas i miedź.', '', 'mango-sztuka', '', '', '', 'Mango sztuka', '', '', '', ''),
(62, 1, 1, 'papryka zielona 100%.\n\nOznakowanie alergenów: wielkimi literami', '', 'papryka-zielona-wazona', '', '', '', 'Papryka zielona ważona', '', '', '', ''),
(63, 1, 1, 'Burak to warzywo, którego nie może zabraknąć na naszych stołach - ze względu na walory smakowe, dietetyczne i zdrowotne. Buraki są prawdziwą „kopalnią” składników mineralnych (m. in. żelaza, potasu, magnezu, fosforu, manganu, miedzi i cynku), witamin (kwasu foliowego, witaminy C, B2 i B6), błonnika pokarmowego, fitosteroli roślinnych i przeciwutleniaczy. Warzywo to jest także źródłem mało znanych pierwiastków - cezu i rubidu,a swój piękny i intensywny kolor zawdzięczają obecności betaniny – antyutleniacza, który chroni nasz organizm przed niszczącym działaniem wolnych rodników. Dobry burak powinien charakteryzować się cienką skórką oraz jednolitą barwą na przekroju. Im jest ciemniejsza, tym burak ma więcej antocyjanów (rodzaj flawonoidów), a im bardziej jego struktura jest porowata, tym burak jest bardziej ciężkostrawny. Składniki mineralne zawarte w tych warzywach rozpuszczają się w wodzie, dlatego lepiej ich nie gotować, chyba że w zupie. Buraki będą bardziej wartościowe, jeśli zostaną upieczone w skórce i obrane dopiero przed jedzeniem. Najwięcej wartości odżywczych ma surowy sok z buraków, więc spożywanie ich właśnie w takiej formie przyniesie nam najwięcej korzyści zdrowotnych. Buraki obniżają ciśnienie krwi, działają antynowotworowo, krwiotwórczo, wzmacniają odporność organizmu, wspomagają nasz organizm w infekcjach bakteryjnych i wirusowych, dodają energii, poprawiają nastrój, redukują oznaki starzenia się, a także poprawiają stan skóry, włosów i paznokci.', '', 'jzn-buraki-luzem', '', '', '', 'JZN BURAKI LUZEM', '', '', '', ''),
(64, 1, 1, 'Warzywo pochodzące z północnych terenów Chin i Japonii. Jest uprawiane także w wielu rejonach świata o klimacie umiarkowanym. Surowa kapusta pekińska, delikatnie krucha i słodka w smaku, sprawdzi się jako składnik sałatek i surówek. Można ją także gotować, smażyć i zapiekać. Ciekawostka: kapusta pekińska jest głównym składnikiem tradycyjnego dania kuchni koreańskiej - KIMCHI, które składa się z fermentowanych i kiszonych warzyw. W Korei danie to jest popularną przystawką i ważnym elementem każdego posiłku.', '', 'kapusta-pekinska-wazona', '', '', '', 'Kapusta pekińska ważona', '', '', '', ''),
(65, 1, 1, '- PRODUKT POLSKI - opakowanie biodegradowalne', '', 'wloszczyzna-tacka-650-g', '', '', '', 'Włoszczyzna tacka 650 g', '', '', '', ''),
(66, 1, 1, 'Boczniaki to grzyby, które pochodzą z Chin, ale są coraz bardziej popularne w innych regionach Świata, także w Polsce. Można spożywać je po przetworzeniu jako osobne danie lub jako dodatek do mięs, sosów czy innych potraw. Grzyby te odznaczają się specyficznymi walorami smakowo-zapachowymi, ale cenione są również za obecność składników odżywczych pozytywnie wypływających na organizm człowieka. Dlatego grzyby te mogą stanowić ciekawą alternatywę dla wegetarian poprzez wzbogacenie ich diety w brakujące mikro i markoelementy. Boczniaki charakteryzują się niską kalorycznością i indeksem glikemicznym. Zawierają także mało tłuszczu, a ten w nich obecny, w dużej mierze stanowią nienasycone kwasy tłuszczowe. Warto zauważyć, że grzyby te są także źródłem łatwo przyswajalnego białka. Zawierają witaminy B i D, kwas foliowy i pierwiastki takie jak: wapń, potas czy sód. Na szczególna uwagę zasługują także β-glukany (związki należące do węglowodanów), które wykazują prozdrowotne właściwości - odbudowują nabłonek oraz wspomagają leczenie chorób nowotworowych. Bardzo ważną rolę spełniają w układzie immunologicznym, przez stymulowanie dojrzewania komórek odpornościowych.', '', 'boczniaki-opakowanie-250-g', '', '', '', 'Boczniaki opakowanie 250 g', '', '', '', ''),
(67, 1, 1, 'W naszych sklepach sprzedajemy wyłącznie awokado „ready to eat” – „gotowe do zjedzenia”, które w odróżnieniu od standardowego, poddawane jest procesowi dojrzewania w odpowiednich komorach. Dzięki temu zabiegowi, już w momencie zakupu, nadają się do spożycia. Miąższ dojrzałego awokado ma mazistą konsystencję podobną do masła, zaś jego delikatny smak przypomina orzech włoski. To właśnie konsystencja awokado pozwala na przygotowanie z niego aromatycznej pasty. Idealnie pasuje także do sałatek lub jako dodatek do kanapek. Oprócz zastosowania w kuchni, nadaje się jako komponent maseczek do twarzy czy włosów.', '', 'awokado-duze-sztuka', '', '', '', 'Awokado duże sztuka', '', '', '', ''),
(68, 1, 1, 'Cebula "Jakość z Natury Carrefour" charakteryzuje się delikatnym i swoistym smakiem. Uprawiana jest w wyselekcjonowanych gospodarstwach zlokalizowanych w centrum Nizimy Błońskiej. Regularne badania gleby prowadzone podczas uprawy pozwalają na dobranie odpowiednich nawozów w optymalnych ilościach. Po zbiorach, cebula jest przechowywana w naturalnych warunkach - nie są stosowane zabiegi fitosanitarne przeciwko wyrastaniu szczypioru.', '', 'cebula-jakosc-z-natury-carrefour-1-kg', '', '', '', 'Cebula "Jakość z Natury Carrefour" 1 kg', '', '', '', ''),
(69, 1, 1, 'PRODUKT POLSKI&gt;\n\nSurowce do produkcji pochodzą\nz własnych upraw.\n\nProdukt otrzymany w wyniku\nnaturalnej fermentacji mlekowej.', '', 'ogorki-kiszone-folia-700-g', '', '', '', 'Ogórki kiszone folia 700 g', '', '', '', ''),
(70, 1, 1, 'Kapusta biała to warzywo o szerokim zasotosowaniu kulinarnym, które odgrywa szczególną rolę w kuchni polskiej. Spotkać ją bowiem możemy w tradycyjnym bigosie, gołąbkach czy faruszu do pierogów. Kapustę białą możemy spożywać na surowo, duszoną, gotowaną, kiszoną, a nawet smażoną. Znana ludzkości już w czasach starożytnego Rzymu, kiedy uważano ją za roślinę o dietetycznych i leczniczych właściwościach.', '', 'kapusta-biala-wazona', '', '', '', 'Kapusta biała ważona', '', '', '', ''),
(71, 1, 1, 'Bakłażan pochodzi z Indii, ale obecnie uprawiany jest w wielu krajach. Można go spożywać w wersji plastrów bakłażana z grilla (np. z serem feta), szaszłyków, ale także jako dodatek do gulaszu czy w postaci pasty na kanapki, do makaronów lub do naleśników. Warto docenić smak bakłażana, ponieważ jego regularne spożywanie wspomaga prawidłowe funkcjonowanie naszego organizmu oraz zapobiega chorobom. Jest źródłem bardzo silnego antyoksydantu, którego działanie nie tylko chroni przed starzeniem się organizmu oraz zmniejsza ryzyko chorób nowotworowych, ale także może je leczyć. Udowodniono bowiem, że nasunin redukuje rozrost nowych naczyń krwionośnych nowotworu. Najwięcej tego związku występuję w skórce, dlatego nie należy jej usuwać. Jest źródłem głównie witamin z grupy B, potasu, magnezu, fosforu oraz cynku, niezbędnych w prawidłowym funkcjonowaniu układu nerwowego, układu krążenia, pracy mięśni, budowy kości oraz pracy tarczycy. Zawiera sporo błonnika pokarmowego, który reguluję pracę przewodu pokarmowego, zapobiegając i lecząc zaparcia, wypełnia żołądek, a do tego reguluje tempo wzrostu glukozy we krwi, dzięki czemu uczucie sytości po posiłku pozostaje na dłuższy czas. Błonnik pokarmowy obecny w bakłażanie pomaga również w redukcji cholesterolu we krwi oraz oczyszcza organizm z pozostałości przemiany materii.', '', 'baklazan-wazony', '', '', '', 'Bakłażan ważony', '', '', '', ''),
(72, 1, 1, 'Do produkcji naszej kapusty kiszonej używamy wyłącznie warzyw pochodzących z certyfikowanych gospodarstw ekologicznych. Tradycyjny proces produkcji gwarantuje zachowanie najwyższej jakości. Produkt nie jest pasteryzowany, nie zawiera żadnych konserwantów, regulatorów kwa­so­wości ani przeciwutleniaczy. Każde opakowanie wyposażone jest w wentyl, dzięki któremu odprowadzane są naturalne gazy, powstające w procesie fermentacji.', '', 'charsznicka-kapusta-kiszona-600-g', '', '', '', 'Charsznicka kapusta kiszona 600 g', '', '', '', ''),
(73, 1, 1, 'Słodki, soczysty i bardzo aromatyczny owoc. Pochodzi z tropikalnej części Ameryki Południowej, obecnie jest uprawiany w w Chinach, Tajlandii, USA, Meksyku, na Filipinach i w Afryce Południowej. Do Europy został przewieziony z Gwadelupa przez Krzysztofa Kolumba.', '', 'ananas-wazony', '', '', '', 'Ananas ważony', '', '', '', ''),
(74, 1, 1, 'Kalarepa to smaczne warzywo cenione głównie za swoje walory dietetyczne i wyjątkowy smak.\nJest delikatna w smaku, lekko słodkawa, a jednocześnie pikantna.\nKalarepa jest niskokaloryczna i zawiera dużo błonnika pokarmowego, co sprawia,\nże warzywo to jest polecane osobom będącym na diecie.\nNajlepsze w smaku okazy kupuje się wiosną i spożywa zazwyczaj na surowo lub w surówkach,\nnatomiast późniejsze odmiany (twardsze) najlepiej podawać na ciepło - dusić, piec, zapiekać lub dodawać do zup.', '', 'kalarepa-sztuka', '', '', '', 'Kalarepa sztuka', '', '', '', ''),
(75, 1, 1, 'papryka czerwona, papryka zielona, papryka żółta.\n\nOznakowanie alergenów: wielkimi literami', '', 'papryka-mix-3-sztuki', '', '', '', 'PAPRYKA MIX 3 SZTUKI', '', '', '', ''),
(76, 1, 1, 'Świeży, smaczny, soczysty ogórek - o szerokim zastosowaniu kulinarnym.', '', 'ogorek-dlugi-sztuka', '', '', '', 'OGÓREK DŁUGI SZTUKA', '', '', '', ''),
(77, 1, 1, 'Simply\n    \n\n        Odmiana: Red PrinceKaliber: 65-75 mmKlasa: I}\n    \n\nProdukt polski\n\n\n        Jabłko.', '', 'simply-jablka-z-polskich-sadow-1-kg', '', '', '', 'Simply Jabłka z polskich sadów 1 kg', '', '', '', ''),
(78, 1, 1, 'Mandarynka 100%.\n\nOznakowanie alergenów: wielkimi literami', '', 'mandarynka-siatka-1kg', '', '', '', 'Mandarynka siatka 1kg', '', '', '', ''),
(79, 1, 1, '- smaczne odmiany typu A "sałatkowe" - uprawiane w wybranych gospodarstwach Niziny Błońskiej - bezpieczne dzięki kontroli jakości "od pola do talerza"', '', 'ziemniaki-do-zup-i-salatek-jakosc-z-natury-carrefour-15-kg', '', '', '', 'Ziemniaki do zup i sałatek "Jakość z Natury Carrefour" 1,5 kg', '', '', '', ''),
(80, 1, 1, 'Jarmuż cięty, myty, gotowy do spożycia.', '', 'jarmuz-myty-150-g', '', '', '', 'Jarmuż myty 150 g', '', '', '', ''),
(81, 1, 1, 'Simply\n    \n\nProdukt polski\n\n\n        Marchew.', '', 'simply-marchew-z-polskich-upraw-1-kg', '', '', '', 'Simply Marchew z polskich upraw 1 kg', '', '', '', ''),
(82, 1, 1, 'Odmiana Ramiro to spiczasta, słodka papryka pozbawiona pestek.', '', 'papryka-ramiro-czerwona-200-g', '', '', '', 'PAPRYKA RAMIRO CZERWONA 200 g', '', '', '', ''),
(83, 1, 1, 'Dynia to produkt sezonowy o szerokim zastosowaniu kulinarnym, ciekawych walorach smakowych i wysokiej wartości odżywczej. W dyni możemy znaleźć wiele cennych witamin i składników mineralnych, w skład których wchodzi: witamina A, B1, B2, B3, C, beta-karoten, wapń, potas, magnez, fosfor i żelazo, mangan, selen i cynk. Dodatkowo pestki dyni to znakomite źródło nienasyconych kwasów tłuszczowych i związków z grupy fitosteroli.', '', 'bio-dynia-hokkaido-szt', '', '', '', 'BIO dynia hokkaido szt.', '', '', '', ''),
(84, 1, 1, 'Smaczny owoc idealnie nadający się na przekąskę. Są​ doskonałe​ ​na surowo. ​Dzięki​ ​ kwaskowej​ nucie​ są wyraziste​ w smaku​. Najczęściej wykorzystywane​ ​w​ ​przetworach​, ale​ ​ także​ ​wybornie też​ ​smakują​ ​jako​ ​dodatek​ ​do​ kaczki. Jabłka zapakowane po 4 sztuki na tacce.', '', 'jablka-grojeckie-jonaprince-tacka-4-sztuki', '', '', '', 'Jabłka Grójeckie Jonaprince - tacka 4 sztuki', '', '', '', ''),
(85, 1, 1, 'Smaczny owoc idealnie nadający się na przekąskę.\nNadają się do przetworów ​(dżemy, marmolady ​i​ ​musy).​ ​Świetne​ ​na​ ​soki​ ​i kompoty.​ ​Można​ ​je​ ​piec​ ​i​ ​wykorzystywać​ jako​ ​dodatek​ do​ ​mięs​ ​i​ ​ciast​ ​takich​ ​jak​ ​szarlotki, strudle​ ​i​ ​drożdżówki. Jabłka zapakowane po 4 sztuki na tacce.', '', 'jablka-grojeckie-golden-delicious-tacka-4-sztuki', '', '', '', 'Jabłka Grójeckie Golden Delicious - tacka 4 sztuki', '', '', '', ''),
(86, 1, 1, 'Do diety warto włączyć także sałatę rzymską mini, mniejszą wersje sałaty rzymskiej, o mięsistych i chrupiących liściach. Jej smakiem możemy cieszyć się przez dłuższy czas czasu ponieważ jest bardzo trwała. Jest smaczna zarówno na surowo jak i po przetworzeniu. Polecamy smażoną z czosnkiem i posypaną parmezanem.', '', 'salata-rzymska-mini', '', '', '', 'SAŁATA RZYMSKA "MINI"', '', '', '', ''),
(87, 1, 1, 'Znana była już w Starożytności, lecz nie miała wtedy znaczenia jako warzywo, gdyż jej smak bardzo różnił się – na niekorzyść – od smaku dzisiejszej marchwi. Dopiero w XVI wieku, gdy wyhodowano odmianę o jędrnym korzeniu i o słodkawym smaku, została wprowadzona do kuchni. Obecnie znana jest i wykorzystywana chyba we wszystkich kuchniach świata. Marchew zawiera witaminy B, C, D, E, K i beta- karoten oraz takie minerały jak wapń, żelazo, fosfor, chrom, magnez, potas, sód, jod, krzem, chlor i siarka. Poprawia zdolność widzenia w ciemnościach i dba o oczy. Jest doskonała na problemy ze skórą. Łagodzi stany zapalne błon śluzowych jelit i dróg oddechowych. Oczyszcza i tonizuje wątrobę. Pomaga przy leczeniu owrzodzenia i stanów zapalnych żołądka oraz jelit. Poprawia witalność i wigor. Poprawia jakość mleka z piersi i dba o zdrowie kobiet w ciąży. Jest doskonała dla dorastających dzieci.', '', 'bio-marchew-500-g', '', '', '', 'BIO marchew 500 g', '', '', '', ''),
(88, 1, 1, 'Jedna z kolorystycznych odmian papryki o wyjątkowo słodkim smaku i szerokim zastosowaniu kulinarnym. Można dodawać ją do sałatek, zup, jako dodatek do mięs, sosów czy kanapek. Duże pole do popisu dają także możliwości jej przyrządzenia. Możemy ją lekko poddusić, upiec, usmażyć czy spożywać na surowo. Każdorazowo smakuje tak samo dobrze.', '', 'papryka-pomaranczowa-wazona', '', '', '', 'Papryka pomarańczowa ważona', '', '', '', ''),
(89, 1, 1, 'Najpopularniejszy wśród melonów. Jego skórka jest żółto - brązowa, pokryta jasnym siateczkowatym wzorem. Miąższ od koloru białawego do kremowo - żółtego. Smakiem przypomina połączenie ogórka i miodu. Wraz z arbuzem, ogórkiem, dynią i cukinią, melon tworzy rodzinę jednorocznych roślin dyniowatych. Dojrzałe i słodkie melony zazwyczaj jada się w naturalnej postaci, pokrojone na ćwiartki i w kostkę. Melony dodaje się do sałatek, kompotów i deserów, robi się z nich lody, sorbety i zupy na zimno, przyrządza dżemy oraz cztneje (gęste, ostre sosy). Niektóre gatunki można też marynować i dusić. Przecier z miąższu melona jest znakomitym dodatkiem do gęstych drinków i ponczów owocowych.. Kawałki melona z cieniutkimi plastrami szynki parmeńskiej to jedna z najbardziej znanych przystawek na świecie.', '', 'melon-galia-wazony', '', '', '', 'Melon Galia ważony', '', '', '', ''),
(90, 1, 1, 'PRODUKT POLSKI.\n\nSurowce do produkcji pochodzą \nz własnych upraw.\n\nProdukt otrzymany w wyniku \nnaturalnej fermentacji \nmlekowej.', '', 'kapusta-kiszona-folia-500g', '', '', '', 'Kapusta kiszona folia 500g', '', '', '', ''),
(91, 1, 1, '-Produkt Polski -Produkcja bez pestycydów', '', 'mieta-ogrodowa-swieza', '', '', '', 'Mięta ogrodowa świeża', '', '', '', ''),
(92, 1, 1, 'Gruszki "Jakość z Natury Carrefour" uprawiane są na terenach z długoletnią tradycją sadownictwa\nw okolicach Grójca przez wybranego producenta, z którym współpracujemy od 1997 r.\nDzięki naturalnym metodom walki ze szkodnikami oraz stałej obserwacji sadów, środki fitosanitarne\nw uprawie są wyeliminowane lub zmniejszone do minimum.\nGruszki Jakość z Natury Carrefour wyróżniają się od innych delikatnym, słodkim i soczystym miąższem\noraz kontrolowaną uprawą bez stosowania zabiegów fitosanitarnych po zbiorach.', '', 'gruszka-jakosc-z-natury-carrefour-tacka-4-sztuki', '', '', '', 'Gruszka  "Jakość z Natury Carrefour", tacka 4 sztuki', '', '', '', ''),
(93, 1, 1, 'Na świecie możemy wyróżnić prawie 10 tysięcy odmian jabłek. W zależności od gatunku, owoce te różnią się od siebie kolorem, kształtem, miękkością i smakiem. Jabłka mają wiele cennych właściwości. Zawierają witaminy: C, A, B1, B2, PP i B3, mikro- i makroelementy takiej jak: potas, wapń, magnez, krzem, żelazo, siarkę, miedź i cynk.', '', 'jablka-luz', '', '', '', 'Jabłka Luz', '', '', '', ''),
(94, 1, 1, 'Uprawiane są na terenie z długoletnią tradycją sadownictwa - w okolicach Grójca. Dzięki naturalnym metodom walki ze szkodnikami oraz stałej obserwacji sadów, środki fitosanitarne w uprawie są wyeliminowane lub zmniejszone do minimum. Jabłka "Jakość z Natury Carrefour" zbierane są w pełni dojrzałości dla uzyskania najlepszego smaku. Produkt jest zapakowany w wygodne, 6-sztukowe opakowanie.', '', 'jablka-jakosc-z-natury-carrefour-tacka-6-szt', '', '', '', 'Jabłka "Jakość z Natury Carrefour",  tacka 6 szt.', '', '', '', ''),
(95, 1, 1, '- Wysoka zawartość błonnika pokarmowego.', '', 'orzechy-wloskie-400-g', '', '', '', 'Orzechy włoskie 400 g', '', '', '', ''),
(96, 1, 1, 'czosnek ząbki 100%.\n\nOznakowanie alergenów: wielkimi literami', '', 'czosnek-zabki-100-g', '', '', '', 'Czosnek ząbki 100 g', '', '', '', ''),
(97, 1, 1, 'Melon Cantalupe ma charakterystyczną kremowo - zielonkawą skórką pokryta jasnymi podłużnymi pasami biegnącymi od góry do dołu owocu. Jest owalnego kształtu. W smaku słodki, aromatyczny. Wraz z arbuzem, ogórkiem, dynią i cukinią, melon tworzy rodzinę jednorocznych roślin dyniowatych. Dojrzałe i słodkie melony zazwyczaj jada się w naturalnej postaci, pokrojone na ćwiartki i w kostkę. Melony dodaje się do sałatek, kompotów i deserów, robi się z nich lody, sorbety i zupy na zimno, przyrządza dżemy oraz cztneje (gęste, ostre sosy). Niektóre gatunki można też marynować i dusić. Przecier z miąższu melona jest znakomitym dodatkiem do gęstych drinków i ponczów owocowych. Kawałki melona z cieniutkimi plastrami szynki parmeńskiej to jedna z najbardziej znanych przystawek na świecie.', '', 'melon-cantaloupa-wazony', '', '', '', 'Melon Cantaloupa ważony', '', '', '', ''),
(98, 1, 1, 'Świeża, krucha sałata lodowa idealna do sałatek i surówek.', '', 'salata-lodowa-sztuka', '', '', '', 'Sałata lodowa sztuka', '', '', '', ''),
(99, 1, 1, 'PRODUKT POLSKI. Surowce do produkcji pochodzą z własnych upraw. Produkt otrzymany w wyniku naturalnej fermentacji mlekowej.', '', 'kapusta-kiszona-wiaderko-1kg', '', '', '', 'Kapusta kiszona wiaderko 1kg', '', '', '', ''),
(100, 1, 1, 'Owoce, których smak i konsystencję można określić jako "pomiędzy morelą i pomidorem". Dojrzałe owoce posiadają żółto-pomarańczową skórkę, z ewentualnie z zielonym przebarwieniem przy kielichu. Ich miąższ jest miękki, szklisty, słodki i soczysty. Można spożywać je na surowo lub w formie gotowanej, kandyzowanej , przerobionej na dżemy, galaretki, czy lody.', '', 'sharon-kaki-sztuka', '', '', '', 'Sharon kaki sztuka', '', '', '', ''),
(101, 1, 1, 'Uprawiane są na terenie z długoletnią tradycją sadownictwa - w okolicach Grójca. Dzięki naturalnym metodom walki ze szkodnikami oraz stałej obserwacji sadów, środki fitosanitarne w uprawie są wyeliminowane lub zmniejszone do minimum. Jabłka "Jakość z Natury Carrefour" zbierane są w pełni dojrzałości dla uzyskania najlepszego smaku. Produkt zapakowany jest w wygodne, 4-sztukowe opakowanie.', '', 'jablka-jakosc-z-natury-carrefour-tacka-4-szt', '', '', '', 'Jabłka "Jakość z Natury Carrefour", tacka 4 szt.', '', '', '', ''),
(102, 1, 1, 'KRESTO\n    \n\n        Orzechy włoskie.', '', 'kresto-orzechy-wloskie-200-g', '', '', '', 'KRESTO Orzechy włoskie 200 g', '', '', '', ''),
(103, 1, 1, 'Czosnek ze względu na swój intensywny smak jest doskonałym dodatkiem do wielu potraw.', '', 'jzn-czosnek-3-szt', '', '', '', 'JzN Czosnek 3 szt.', '', '', '', ''),
(104, 1, 1, '- Źródło błonnika pokarmowego.', '', 'rodzynki-sultanskie-400-g', '', '', '', 'Rodzynki Sułtańskie 400 g', '', '', '', ''),
(105, 1, 1, 'Bakalland\n    \n\n        Rodzynki Bakalland powstają z dorodnych, dobrze wysuszonych winogron. Rodzynki to źródło witaminy B6 i manganu. Bogate są również w miedź i potas, który korzystnie wpływa na układ nerwowy. Choć zazwyczaj są stosowane jako dodatek do wypieków i deserów, coraz częściej, zarówno dzieci jak i dorosłych, stanowią także pożywną przekąskę w ciągu dnia.}\n    \n\nnaturalne źródło żelaza, potasu i witaminy B6\nDobra i Polska firma\n\n\n        Rodzynki sułtańskie', '', 'bakalland-rodzynki-sultanskie-500-g', '', '', '', 'Bakalland Rodzynki sułtańskie 500 g', '', '', '', ''),
(106, 1, 1, 'Ma delikatny, lekko orzechowy smak i przetrwa w lodówce nawet przez tydzień.', '', 'salata-karbowana-czerwona-sztuka', '', '', '', 'Sałata karbowana czerwona sztuka', '', '', '', ''),
(107, 1, 1, '- źródło błonnika pokarmowego', '', 'migdaly-400-g', '', '', '', 'Migdały 400 g', '', '', '', ''),
(108, 1, 1, 'Dynia to produkt sezonowy o szerokim zastosowaniu kulinarnym, ciekawych walorach smakowych i wysokiej wartości odżywczej. W dyni możemy znaleźć wiele cennych witamin i składników mineralnych, w skład których wchodzi: witamina A, B1, B2, B3, C, beta-karoten, wapń, potas, magnez, fosfor i żelazo, mangan, selen i cynk. Dodatkowo pestki dyni to znakomite źródło nienasyconych kwasów tłuszczowych i związków z grupy fitosteroli.', '', 'dynia-wazona', '', '', '', 'Dynia ważona', '', '', '', ''),
(109, 1, 1, 'Surowce do produkcji pochodzą z własnych upraw. Produkt otrzymany w wyniku naturalnej fermentacji mlekowej.', '', 'kapusta-kiszona-z-marchewka-wiaderko-1kg', '', '', '', 'Kapusta kiszona z marchewką wiaderko 1kg', '', '', '', ''),
(110, 1, 1, 'Wyjątkowo słodka odmiana pomidora cherry o drobnych, soczystych i nieco wydłużonych owocach. Małe pomidorki daktylowe sprawdzą się idealnie jako dodatek do sałatek, tart, przekąsek lub jako subtelna ozdoba talerza.', '', 'pomidory-cherry-mix-500-g', '', '', '', 'Pomidory cherry MIX 500 g', '', '', '', ''),
(111, 1, 1, '-Produkt Polski -Produkcja bez pestycydów', '', 'pietruszka-swieza', '', '', '', 'Pietruszka świeża', '', '', '', ''),
(112, 1, 1, 'KRESTO\n    \n\n        Nadające się do recyklingu\n    \n\n        Rodzynki.', '', 'kresto-rodzynki-200-g', '', '', '', 'KRESTO Rodzynki 200 g', '', '', '', ''),
(113, 1, 1, '-Produkt Polski -Produkcja bez pestycydów', '', 'szczypiorek-swiezy', '', '', '', 'Szczypiorek świeży', '', '', '', ''),
(114, 1, 1, 'Produkt pochodzący z certyfikowanych upraw ekologicznych.', '', 'banany-bio', '', '', '', 'Banany BIO', '', '', '', ''),
(115, 1, 1, 'Zdrowie - kiełki słonecznika zawierają dużą ilość wapnia i fosforu.\nDostarczają tym samym organizmowi substancje mineralne wzmacniające kości i zęby.\nPosiadają również żelazo, które stanowi niezbędny element w procesie krwiotwórczym.\nBogate są w magnez i potas oraz w mniejszym stopniu w miedź i cynk. Szczególnie cennym elementem jest witamina D,\nbardzo rzadko występująca w warzywach. Smak - kiełki słonecznika posiadają bardzo wyrazisty smak, lekko orzechowy.\nŚwietnie komponują się z sałatkami i kanapkami. Mogą być także wykorzystywane do przybrania dań, dzięki ciekawemu wyglądowi.', '', 'goh-kielki-slonecznika-50-g', '', '', '', 'GOH Kiełki słonecznika 50 g', '', '', '', ''),
(116, 1, 1, 'Bakalland\n    \n\n        Żurawina Bakalland to przede wszystkim całe, dorodne owoce. Jest to idealna alternatywa dla niezdrowych przekąsek oraz atrakcyjny zamiennik słodyczy dla najmłodszych. Żurawina jest również świetnym dodatkiem do wypieków, dań wytrawnych i sałatek.}\n    \n\nnaturalne źródło błonnika pokarmowego\ndobra i polska firma\n\n\n        Żurawina słodzona, suszona, całe owoce', '', 'bakalland-zurawina-suszona-400-g', '', '', '', 'Bakalland Żurawina suszona 400 g', '', '', '', ''),
(117, 1, 1, 'Papryka sweet bite to odmiana słodkiej papryki jest niezwykle chrupiąca i słodka.\nPapryka to nie tylko przyprawa, ale także afrodyzjak. Za ojczyznę papryki uważa się Kolumbię, stamtąd uprawę rozszerzono na inne rejony świata. W Europie paprykę spopularyzowali Węgrzy.', '', 'papryczka-sweet-bite-200-g', '', '', '', 'Papryczka sweet bite 200 g', '', '', '', ''),
(118, 1, 1, 'Arbuz (nazywany kawonem) pochodzi z Afryki Południowej, gdzie nadal rośnie dziko, a jako gatunek uprawny został rozprzestrzeniony w wielu innych regionach świata charakteryzujących się ciepłym klimatem. W 92% składa się z wody i zawiera niewielką ilość witamin i składników mineralnych. Jednak arbuzy ceni się za inne właściwości m.in. dużą zawartość przeciwutleniaczy, które opóźniają proces starzenia i hamują rozwój komórek nowotworowych. Sezon na te owoce zaczyna się w maju i trwa do połowy września. Arbuz mini ma charakterystyczny kulisty kształt i jak sama nazwa mówi jest miniaturową formą swojego standardowego odpowiednika. Jest delikatniejszy i słodszy w smaku, a jego skórka jest zdecydowanie cieńsza. Idealny jako przekąska na gorące dni. Nadaje się także do deserów, sorbetów i sałatek.', '', 'arbuz-mini-wazony', '', '', '', 'Arbuz mini ważony', '', '', '', ''),
(119, 1, 1, 'Siemię lniane bogate w wartości odżywcze idealnie urozmaici każdą dietę.', '', 'siemie-lniane-200g', '', '', '', 'Siemię lniane 200g', '', '', '', ''),
(120, 1, 1, 'Kruche, aromatyczne, suszone krążki banana. Produkt bez substancji konserwujących.', '', 'chipsy-bananowe-100-g', '', '', '', 'Chipsy bananowe 100 g', '', '', '', ''),
(121, 1, 1, 'Bakalland\n    \n\n        Daktyle Bakalland są naturalną przekąską, to także składniki wielu ciast i deserów.}\n    \n\nnaturalne źródło błonnika, bogactwo potasu\nDobra i polska firma\n\n\n        Daktyle suszone drylowane', '', 'bakalland-daktyle-suszone-400-g', '', '', '', 'Bakalland Daktyle suszone 400 g', '', '', '', ''),
(122, 1, 1, 'morele suszone bez pestek, substancja konserwująca: DWUTLENEK SIARKI. Produkt może zawierać: ORZESZKI ZIEMNE, INNE ORZECHY, NASIONA SEZAMU, GLUTEN PSZENNY, MLEKO (ŁĄCZNIE Z LAKTOZĄ) I SOJĘ.\n\nOznakowanie alergenów: wielkimi literami', '', 'morele-suszone-400-g', '', '', '', 'Morele suszone 400 g', '', '', '', ''),
(123, 1, 1, 'Ziarna słonecznika BIO to idealna przekąska lub chrupki dodatek do sałatek czy farszy.', '', 'slonecznik-luskany-bio-200-g', '', '', '', 'Słonecznik łuskany BIO 200 g', '', '', '', ''),
(124, 1, 1, 'Grapefruit jest mieszanką pomelo i słodkich pomarańczy. Jego miąższ jest intensywnie czerwony. W smaku słodki, z charakterystycznym goryczkowym posmakiem. Bardzo soczysty - można wyciskać z niego sok.', '', 'grapefruit-czerwony-wazony', '', '', '', 'Grapefruit czerwony ważony', '', '', '', ''),
(125, 1, 1, 'Kiszony, niepasteryzowany, bez dodatku substancji konserwujących.', '', 'zur-05-l', '', '', '', 'Żur 0,5 l', '', '', '', ''),
(126, 1, 1, 'Owoce daktylowca pozbawione pestek. Produkt bez substancji konserwujących.', '', 'daktyle-200-g', '', '', '', 'Daktyle 200 g', '', '', '', ''),
(127, 1, 1, 'Boczniaki to grzyby, które pochodzą z Chin, ale są coraz bardziej popularne w innych regionach Świata, także w Polsce. Można spożywać je po przetworzeniu jako osobne danie lub jako dodatek do mięs, sosów czy innych potraw. Grzyby te odznaczają się specyficznymi walorami smakowo-zapachowymi, ale cenione są również za obecność składników odżywczych pozytywnie wypływających na organizm człowieka. Dlatego grzyby te mogą stanowić ciekawą alternatywę dla wegetarian poprzez wzbogacenie ich diety w brakujące mikro i markoelementy. Boczniaki charakteryzują się niską kalorycznością i indeksem glikemicznym. Zawierają także mało tłuszczu, a ten w nich obecny, w dużej mierze stanowią nienasycone kwasy tłuszczowe. Warto zauważyć, że grzyby te są także źródłem łatwo przyswajalnego białka. Zawierają witaminy B i D, kwas foliowy i pierwiastki takie jak: wapń, potas czy sód. Na szczególna uwagę zasługują także β-glukany (związki należące do węglowodanów), które wykazują prozdrowotne właściwości - odbudowują nabłonek oraz wspomagają leczenie chorób nowotworowych. Bardzo ważną rolę spełniają w układzie immunologicznym, przez stymulowanie dojrzewania komórek odpornościowych.', '', 'boczniaki-opakowanie-05-kg', '', '', '', 'Boczniaki opakowanie 0,5 kg', '', '', '', ''),
(128, 1, 1, 'Suszone śliwki pomagają w prawidłowym funkcjonowaniu jelit. Korzystne działanie występuje w przypadku spożycia 100g śliwek dziennie. Pamiętaj, że bardzo ważny jest zrównoważony sposób żywienia i zdrowy tryb życia. - Wysoka zawartość błonnika pokarmowego.', '', 'sliwki-suszone-400-g', '', '', '', 'Śliwki suszone 400 g', '', '', '', ''),
(129, 1, 1, 'Helio\n    \n\n        Nadające się do recyklingu\n    \n\n        Sezam łuskany.', '', 'helio-sezam-luskany-200-g', '', '', '', 'Helio Sezam łuskany 200 g', '', '', '', ''),
