(132, 1, 1, 'Helio\n    \n\npraktyczne zamknięcie\n\n\n        Nadające się do recyklingu\n    \n\n        Orzechy brazylijskie', '', 'helio-orzechy-brazylijskie-100-g', '', '', '', 'Helio Orzechy brazylijskie 100 g', '', '', '', ''),
(133, 1, 1, 'Słodkie owoce w formie wygodnego krążka. Produkt bez substancji konserwujących.', '', 'figa-krazek-200g', '', '', '', 'Figa krążek 200g', '', '', '', ''),
(134, 1, 1, 'Starannie wyselekcjonowane rodzynki BIO o szerokim zastosowaniu. Doskonale sprawdzą się jako dodatek do wypieków, musli oraz deserów.', '', 'rodzynki-bio-200-g', '', '', '', 'Rodzynki BIO 200 g', '', '', '', ''),
(135, 1, 1, 'KRESTO\n    \n\n        Orzechy laskowe.', '', 'kresto-orzechy-laskowe-200-g', '', '', '', 'KRESTO Orzechy laskowe 200 g', '', '', '', ''),
(136, 1, 1, 'KRESTO\n    \n\n        Morele suszone bez pestek.', '', 'kresto-morele-suszone-200-g', '', '', '', 'KRESTO Morele suszone 200 g', '', '', '', ''),
(137, 1, 1, 'żurawina suszona 51%, cukier 48%, olej słonecznikowy\nAlergeny: Informacja dla alergików. Produkt może zawierać: orzeszki ziemne, orzechy, sezam, gluten pszenny, mleko (łącznie z laktozą) oraz soję.', '', 'helio-zurawina-suszona-80-g', '', '', '', 'Helio Żurawina suszona 80 g', '', '', '', ''),
(138, 1, 1, 'Idealne jako przekąska lub dodatek do ciast i innych potraw.', '', 'daktyle-suszone-bez-pestek-500-g', '', '', '', 'Daktyle suszone bez pestek 500 g', '', '', '', ''),
(139, 1, 1, 'Idealny dodatek do kanapek.', '', 'salata-karbowana-zielona-sztuka', '', '', '', 'Sałata karbowana zielona sztuka', '', '', '', ''),
(140, 1, 1, 'Papryka piri piri jest jedną z ostrzejszych papryk. Ma palący smak. \nPapryczki piri piri suszone w całości nadają daniom pikantny intensywny smak. Doskonale komponują się z sosami, pastami oraz marynatami do mięs. Mogą też być bazą pikantnej oliwy z oliwek, albo bardzo ostrej salsy. Suszone małe papryczki można także dodać do zupy.', '', 'papryka-piri-piri-80g', '', '', '', 'PAPRYKA PIRI PIRI 80g', '', '', '', ''),
(141, 1, 1, 'Bakalland\n    \n\n        Choć trudno w to uwierzyć, drzewo nerkowca jest bliskim kuzynem mango! Łatwiej to pojąć, gdy się wie, że oprócz pysznej odmiany orzecha rośnie na nim także owoc zwany jabłkiem nanerczowym - chętnie wykorzystywany w sztuce kulinarnej zarówno na surowo, w postaci upieczonej lub jako bakalie.}\n    \n\nnaturalne źródło bogactwo magnezu, żelaza i cynku\nDobra i polska firma\n\n\n        Orzechy nerkowca łuskane', '', 'bakalland-orzechy-nerkowca-300-g', '', '', '', 'Bakalland Orzechy nerkowca 300 g', '', '', '', ''),
(142, 1, 1, '- źródło błonnika pokarmowego', '', 'pistacje-prazone-400-g', '', '', '', 'Pistacje prażone 400 g', '', '', '', ''),
(143, 1, 1, 'Bakalland\n    \n\n        Śliwki Bakalland zachowują soczystość i owalny, jednolity kształt. Suszone śliwki mają pięć razy więcej witaminy A oraz błonnika niż świeże owoce! Świetnie wpływają również na kondycję włosów, ze względu na zawartość miedzi.}\n    \n\nnaturalne źródło potasu, błonnika i witaminy A\nDobra i Polska firma\n\n\n        Śliwki suszone bez pestek', '', 'bakalland-sliwki-suszone-400-g', '', '', '', 'Bakalland Śliwki suszone 400 g', '', '', '', ''),
(144, 1, 1, 'Mięsiste owoce śliwki pozbawione pestek.Idealnie nadają się jako przekąska.', '', 'sliwka-suszona-200g', '', '', '', 'Śliwka suszona 200g', '', '', '', ''),
(145, 1, 1, 'Helio\n    \n\n        Nadające się do recyklingu\n    \n\n        Ziarno kukurydzy do przygotowania popcornu.', '', 'helio-popcorn-ziarno-250-g', '', '', '', 'Helio Popcorn ziarno 250 g', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(146, 1, 1, 'Arbuz (nazywany kawonem) pochodzi z Afryki Południowej, gdzie nadal rośnie dziko, a jako gatunek uprawny został rozprzestrzeniony w wielu innych regionach świata charakteryzujących się ciepłym klimatem. W 92% składa się z wody i zawiera niewielką ilość witamin i składników mineralnych. Jednak arbuzy ceni się za inne właściwości m.in. dużą zawartość przeciwutleniaczy, które opóźniają proces starzenia i hamują rozwój komórek nowotworowych. Sezon na te owoce zaczyna się w maju i trwa do połowy września.', '', 'arbuz-wazony', '', '', '', 'Arbuz ważony', '', '', '', ''),
(147, 1, 1, 'Okrągły owoc palmy kokosowej, który pod swoją twardą, brązową skorupą skrywa warstwę białego twardawego jadalnego miąższu – to z niego produkuje się popularne wiórki kokosowe. Wnętrze orzecha wypełnione jest wodą kokosową, która doskonale gasi pragnienie. Ze zmielonego miąższu można pozyskać mleczko kokosowe – doskonały dodatek do dań kuchni tajskiej.', '', 'orzech-kokosowy-sztuka', '', '', '', 'Orzech kokosowy sztuka', '', '', '', ''),
(148, 1, 1, 'PAPRYCZKA CHILI.\n\nOznakowanie alergenów: wielkimi literami', '', 'papryczka-chili-sztuka', '', '', '', 'PAPRYCZKA CHILI SZTUKA', '', '', '', ''),
(149, 1, 1, 'KRESTO\n    \n\n        Nadające się do recyklingu\n    \n\n        Migdały.', '', 'kresto-migdaly-200-g', '', '', '', 'KRESTO Migdały 200 g', '', '', '', ''),
(150, 1, 1, 'ORZECHY nerkowca BIO 100%. Produkt może zawierać: SEZAM, SELER, ORZECHY ARACHIDOWE I INNE ORZECHY.\n\nOznakowanie alergenów: wielkimi literami', '', 'bio-orzechy-nerkowca-125-g', '', '', '', 'BIO orzechy nerkowca 125 g', '', '', '', ''),
(151, 1, 1, 'Surowe papryczki jalapeno są ostre, ale ich ostrość łagodnieje wraz z długością gotowania. Z papryki jalapeno przygotowuje się chipotle, czyli paprykę, która jest wcześniej wędzona. Dodaje się ją także do zup, serów, sosów, mięs oraz drobiu.', '', 'papryka-jalapeno-80g', '', '', '', 'PAPRYKA JALAPENO 80g', '', '', '', ''),
(152, 1, 1, 'Nashi - potocznie nazywana gruszką chińską, to roślina pochodząca z Azji Wschodniej, obecnie uprawiana w Nowej Zelandii, Tajwanie, Australii oraz Chile. Owoce mają wielkość jabłka i kulisty lub gruszkowaty kształt. Pod żółtawą pokrytą drobnymi punkcikami skórką znajduje się jasny chrupiący miąższ, a w nim komora nasienna mieszcząca liczne pestki. Miąższ ma budowę ziarnistą, stąd nashi bywa nazywane gruszką piaskową. Owoce nashi spożywa się najczęściej surowe i najlepiej gdy są schłodzone. Miąższ jest bardzo soczysty, kwaskowaty i orzeźwiający. Przypomina on gruszkę oraz jabłko. Owoce wykorzystuje się do wytwarzania marmolad, a także jako dodatek do sałatek owocowych. Owoce nashi są mniej wrażliwe na transport i przechowywanie niż zwykle gruszki. Przez dłuższy czas można je przechowywać w chłodni.', '', 'gruszka-nashi-sztuka', '', '', '', 'Gruszka nashi sztuka', '', '', '', ''),
(153, 1, 1, 'Bakalland\n    \n\n        Orzechy nerkowca są naturalnym źródłem magnezu i żelaza. Magnez przyczynia się do zmniejszenia uczucia zmęczenia i znużenia oraz pomaga w prawidłowym funkcjonowaniu układu nerwowego. Żelazo pomaga w utrzymaniu prawidłowych funkcji poznawczych, przyczynia się do utrzymania prawidłowego metabolizmu energetycznego, pomaga w prawidłowej produkcji czerwonych krwinek i hemoglobiny oraz w prawidłowym transporcie tlenu.Korzystne działanie występuje w przypadku spożywania 2 porcji dziennie. Pamiętaj, że zrównoważona dieta i aktywny styl życia są bardzo ważne dla zachowania dobrego samopoczucia i zdrowia.Czy wiesz, że...* Orzechy nerkowca są bliskimi krewnymi mango i pistacji.* Nerkowce skrywają się w mięsistych, czerwonych owocach, tak zwanych jabłkach nanerczowych.* Otwarte orzechy najlepiej przechowywać w lodówce.}\n    \n\nźródło magnezu i żelaza\n\n\n        Orzechy nerkowca łuskane.', '', 'bakalland-orzechy-nerkowca-75-g', '', '', '', 'Bakalland Orzechy nerkowca 75 g', '', '', '', ''),
(154, 1, 1, 'Melon zielony charakteryzuję się podłużnym kształtem, oraz intensywnym, ciemno-zielonym kolorem skórki. Jego miąższ jest kremowo-zielonkawy, słodki i orzeźwiający. Wraz z arbuzem, ogórkiem, dynią i cukinią, melon tworzy rodzinę jednorocznych roślin dyniowatych. Dojrzałe i słodkie melony zazwyczaj jada się w naturalnej postaci, pokrojone na ćwiartki i w kostkę. Melony dodaje się do sałatek, kompotów i deserów, robi się z nich lody, sorbety i zupy na zimno, przyrządza dżemy oraz cztneje (gęste, ostre sosy). Niektóre gatunki można też marynować i dusić. Przecier z miąższu melona jest znakomitym dodatkiem do gęstych drinków i ponczów owocowych. Kawałki melona z cieniutkimi plastrami szynki parmeńskiej to jedna z najbardziej znanych przystawek na świecie.', '', 'melon-zielony-wazony', '', '', '', 'Melon zielony ważony', '', '', '', ''),
(155, 1, 1, 'Physalis jest jednoroczną rośliną pochodzącą z Ameryki Południowej. Dzikie odmiany miechunki pochodzą prawdopodobnie z rejonu And na południe od równika, z Ekwadoru, Boliwii, Peru oraz z północy Chile. Obecnie jest uprawiana w południowej Afryce, Nowej Zelandii, Kolumbii, Indiach, w Australii, na Antylach i Jawie. Owocem miechunki jest jagoda wielkości wiśni o barwie pomarańczowej. W sklepach można je spotkać w wyschniętych  jasnobrązowych, przypominających szary papier kielichach kwiatowych. Owoce są spożywane świeże, ale także w dżemach, galaretach, sosach. Smak owoców jest słodko - kwaśny, przypominający  pomidora. Wartości odżywcze i właściwości zdrowotne miechunki docenili już Inkowie, przez których była nazywana "złotą jagodą". Nic dziwnego ponieważ malutkie owoce miechunki są skarbnicą witamin i składników mineralnych, m.in. witaminy A, C, a także tych z grupy B oraz wapnia i fosforu.', '', 'physalis-100-g', '', '', '', 'Physalis 100 g', '', '', '', ''),
(156, 1, 1, 'Helio\n    \n\n        Nadające się do recyklingu\n    \n\n        Orzechy nerkowca', '', 'helio-orzechy-nerkowca-80-g', '', '', '', 'Helio Orzechy nerkowca 80 g', '', '', '', ''),
(157, 1, 1, 'Pomelo jest największym owocem wśród cytrusów - waga pojedynczej sztuki może dochodzić nawet do 1 kg. Są żółte, żółto-zielone lub różowe i mają grubą skórkę, która pokryta jest woskiem. Miąższ jest żółtawy lub różowy, podzielony na segmenty. W smaku owoce te są podobne do grejpfrutów, ale pozbawione są silnej goryczki, charakterystycznej dla tej grupy owoców. Są także mniej soczyste niż pozostałe cytrusy. Spożywane po raz pierwszy mogą wydawać się lekko suche, jednak jest to ich naturalna cecha. Ich smak jest delikatnie słodki, a przez to wyjątkowy.', '', 'pomelo-wazone', '', '', '', 'Pomelo ważone', '', '', '', ''),
(158, 1, 1, 'Bakalland\n    \n\nnaturalne źródło błonnika pokarmowego\n\n\n        Skórka pomarańczowa kandyzowana', '', 'bakalland-skorka-pomaranczowa-100-g', '', '', '', 'Bakalland Skórka pomarańczowa 100 g', '', '', '', ''),
(159, 1, 1, 'Helio\n    \n\n        Orzechy nerkowca.', '', 'helio-orzechy-nerkowca-300-g', '', '', '', 'Helio Orzechy nerkowca 300 g', '', '', '', ''),
(160, 1, 1, 'Delikatne i soczyste.\nDoskonałe do koktajli owocowo-warzywnych oraz sałatek i kanapek.', '', 'goh-kielki-lucerny-50-g', '', '', '', 'GOH Kiełki lucerny 50 g', '', '', '', ''),
(161, 1, 1, 'KRESTO\n    \n\n        Nadające się do recyklingu\n    \n\n        Wiórki kokosowe.', '', 'kresto-wiorki-kokosowe-200-g', '', '', '', 'KRESTO Wiórki kokosowe 200 g', '', '', '', ''),
(162, 1, 1, 'W kolorach od złota poprzez pomarańczowy, aż do rzeczywistej czerwieni, to są najsłodsze i najbardziej miłe naszemu oku ziarenka. Mała pod względem ziaren ale odżywczo- to potężny członek rodziny strączkowych, są bardzo dobrym źródłem błonnika obniżającego poziom cholesterolu. Soczewica dodaje energii do spalania kalorii, przy jednoczesnym stabilizowaniu cukru we krwi. Ponadto, aby zapewnić powolne spalanie węglowodanów złożonych, soczewica może zwiększyć Twoją energię poprzez uzupełnianie zapasów żelaza. Po ugotowaniu soczewice mają konsystencję puree i dlatego są doskonałe do dań zagęszczonych, takich jak zupy, kremy, zapiekanki, pasztety, różnego rodzaju farsze. Są one również często gotowane z przyprawami, jako indyjska potrawa dahlu.', '', 'florpak-soczewica-czerwona-500-g', '', '', '', 'Florpak Soczewica czerwona 500 g', '', '', '', ''),
(163, 1, 1, 'KRESTO\n    \n\n        Migdały płatki.', '', 'kresto-migdaly-platki-150-g', '', '', '', 'KRESTO Migdały płatki 150 g', '', '', '', ''),
(164, 1, 1, 'KRESTO', '', 'kresto-slonecznik-luskany-500-g', '', '', '', 'KRESTO Słonecznik łuskany 500 g', '', '', '', ''),
(165, 1, 1, '-Produkt Polski -Produkcja bez pestycydów', '', 'rozmaryn-swiezy', '', '', '', 'Rozmaryn świeży', '', '', '', ''),
(166, 1, 1, 'Soczewica czerwona jest doskonała do zup, sałatek, czy różnego rodzaju past i farszów.', '', 'vitalpol-soczewica-czerwona-450-g', '', '', '', 'VitalPol Soczewica czerwona 450 g', '', '', '', ''),
(167, 1, 1, 'żurawina BIO 60%, cukier BIO 39%, olej słonecznikowy BIO 1%. Produkt może zawierać: SEZAM, SELER, ORZESZKI ARACHIDOWE I INNE ORZECHY.\n\nOznakowanie alergenów: wielkimi literami', '', 'zurawina-suszona-bio', '', '', '', 'Żurawina suszona BIO', '', '', '', ''),
(168, 1, 1, 'Helio\n    \n\n        z upraw ekologicznychnaturalnie dla zdrowianaturalnie dla Ciebienaturalnie pod kontrolą}\n    \n\nnaturalnie dla zdrowia\nz upraw ekologicznych\n\n\n        Ziarna słonecznika, łuskane z upraw ekologicznych', '', 'helio-natura-slonecznik-luskany-150-g', '', '', '', 'Helio Natura Słonecznik łuskany 150 g', '', '', '', ''),
(169, 1, 1, 'Kiszony, niepasteryzowany, bez dodatku substancji konserwujących.', '', 'barszcz-bialy-500-ml', '', '', '', 'Barszcz biały 500 ml', '', '', '', ''),
(170, 1, 1, 'Helio\n    \n\nbez konserwantów!\nLaur Konsumenta 2018\noryginalna receptura - mak babuni\n\n\n        Masa makowa z bakaliami', '', 'helio-masa-makowa-z-bakaliami-850-g', '', '', '', 'Helio Masa makowa z bakaliami 850 g', '', '', '', ''),
(171, 1, 1, '100 g zastępuje 1 kg świeżych warzyw.Włoszczyzna suszona to doskonała baza do przyrządzenia zup, sosów i innych potraw. Kompozycję pożywnych warzyw i ziół wystarczy gotować 15 minut aż warzywa staną się miękkie i nadadzą potrawie smak i apetyczny aromat.}\n    \n\nwysuszone z 1 kg świeżej włoszczyzny\nwybieram naturę\nbaza do zup i sosów\n\n\n        Włoszczyzna suszona', '', 'wloszczyzna-suszona-100-g', '', '', '', 'Włoszczyzna suszona 100 g', '', '', '', ''),
(172, 1, 1, '-Produkt Polski -Produkcja bez pestycydów -Bez plastikowej doniczki', '', 'mieta-bio', '', '', '', 'Mięta bio', '', '', '', ''),
(173, 1, 1, 'Helio\n    \n\n        Ziarna słonecznika bez łupinki.', '', 'helio-slonecznik-luskany-500-g', '', '', '', 'Helio Słonecznik łuskany 500 g', '', '', '', ''),
(174, 1, 1, 'Daktyle rosną na drzewach sięgających nawet do 20 m wysokości. Prawdopodobnie daktylowce uprawiano już 5000 lat przed naszą erą. Popularnością cieszą się szczególnie w krajach azjatyckich i Afryce. Są doskonałym źródłem energii, ale mają również inne zalety.\nPomimo dużej zawartości węglowodanów daktyle, zwłaszcza te świeże, pomagają stabilizować poziom cukru we krwi. Dzieje się tak za sprawą wysokiej ilości błonnika pokarmowego, który dodatkowo zapobiega zaparciom, reguluje pracę przewodu pokarmowego oraz odżywia mikroflorę przewodu pokarmowego (zdrowe bakterie żyjące głównie w jelicie grubym i cienkim). Prawidłowy stan mikroflory jelitowej warunkuje zdrowie całego organizmu, a nawet korzystnie wpływa na zdrowie psychiczne.\nDaktyle polecane są po wysiłku fizycznym oraz intelektualnym – uzupełniają zapasy glikogenu w mięśniach i wątrobie, dostarczają sporą dawkę potasu oraz magnezu. Magnez i potas są niezbędne do właściwej pracy mięśni i układu nerwowego – przeciwdziałają skurczom, poprawiają pamięć i koncentrację.\nSą doskonałym źródłem żelaza, które wpływa na prawidłowe ukrwienie organizmu, a dzięki temu mamy więcej energii i sił witalnych. Daktyle polecane są w anemii, w celu uzupełnienia tego składnika.', '', 'daktyle-suszone-z-pestka-tacka-200-g', '', '', '', 'Daktyle suszone z pestką tacka 200 g', '', '', '', ''),
(175, 1, 1, 'Carrefour\n    \n\nwysoka zawartość błonnika pokarmowego\njakość kontrolowana\n\n\n        Migdały łuskane.', '', 'carrefour-extra-migdaly-luskane-180-g', '', '', '', 'Carrefour Extra Migdały łuskane 180 g', '', '', '', ''),
(176, 1, 1, 'Zwana też karłową z uwagi na nieco mniejsze ziarna w porównaniu do fasoli białej gruboziarnistej Piękny Jaś. \nNiczym jednak nie ustępuje jeśli chodzi o wartości odżywcze, smakowe, a także sposoby wykorzystania w kuchni, tak więc możemy z niej przygotować: dania jednogarnkowe, „fasolkę po bretońsku”, pasty, pasztety, zupy, a nawet muffinki, czy tort fasolowy.', '', 'florpak-fasola-piekny-jas-medium-450-g', '', '', '', 'Florpak Fasola Piękny Jaś Medium 450 g', '', '', '', ''),
(177, 1, 1, 'Carrefour\n\nźródło błonnika pokarmowego\njakość kontrolowana\n\nŻurawina cała (Vaccinium macrocarpon) słodzona, suszona.', '', 'carrefour-extra-zurawina-suszona-180-g', '', '', '', 'Carrefour Extra Żurawina suszona 180 g', '', '', '', ''),
(178, 1, 1, 'Carrefour\n    \n\nźródło błonnika pokarmowego\njakość kontrolowana\n\n\n        Śliwki suszone bez pestek odmiany D''agan.', '', 'carrefour-extra-sliwki-suszone-d-agan-180-g', '', '', '', 'Carrefour Extra Śliwki suszone D''agan 180 g', '', '', '', ''),
(179, 1, 1, 'Figa jest owocem figowca pospolitego i uprawia się ją na terenach śródziemnomorskich. W zależności od gatunku, drzewa figowe mogą osiągać nawet do trzydziestu metrów wysokości. Spotkać je można w postaci różnych odmian. Te ciemnofioletowe można spożywać w postaci surowej, zaś jasnozielone nadają się do suszenia, podczas którego nabierają bursztynowo – karmelowej barwy. Po późniejszym sprasowaniu sprzedawane są jako bakalie. Świeże figi zawierają od 15 do 25% glukozy i fruktozy, przeciwutleniacz witaminę C, witaminy z grupy B, witaminę PP oraz karoten. Są bardzo bogate w sole mineralne, zawierają  potas, wapń, magnez, cynk i fosfor.﻿ Figi są najlepszym źródłem wapnia spośród wszystkich produktów roślinnych. 100g tego owocu dostarcza tyle wapnia, ile jedna szklanka mleka. Można jeść zarówno świeże, jak i suszone - same, lub jako składnik wielu potraw: sałatek, deserów, ciast. Stanowią idealny dodatek do wieprzowiny lub dziczyzny. Można przygotowywać z nich przetwory - dżemy, kompoty. Dobre są także ugotowane w czerwonym winie. Suszone figi to nieodzowny składnik kompotu na Boże Narodzenie.', '', 'figa-sztuka', '', '', '', 'Figa sztuka', '', '', '', ''),
(180, 1, 1, 'Małe, słodkie, bezpestkowe, bursztynowe rodzynki sprawdzą się doskonale jako dodatek do wypieków, musli oraz lodów.', '', 'rodzynki-premium-200g', '', '', '', 'Rodzynki premium 200g', '', '', '', ''),
(181, 1, 1, 'Helio\n    \n\n        bez konserwantównaturalnie zdrowenaturalnie dla Ciebienaturalnie wyjątkowy smak}\n    \n\n100% natury\nnaturalnie dla zdrowia\nbez substancji konserwujących\n\n\n        Śliwki suszone bez pestek', '', 'helio-natura-sliwki-suszone-150-g', '', '', '', 'Helio Natura Śliwki suszone 150 g', '', '', '', ''),
(182, 1, 1, 'KRESTO\n    \n\n        Nadające się do recyklingu\n    \n\n        Żurawina suszona, słodzona, cięta.', '', 'kresto-zurawina-200-g', '', '', '', 'KRESTO Żurawina 200 g', '', '', '', ''),
(183, 1, 1, 'Bakalland\n    \n\n        Klasyczna mieszanka studencka, to wysokiej jakości połączenie orzechów arachidowych, rodzynek, orzechów laskowych i orzechów nerkowca. Porcja doskonale skomponowanej przekąski gwarantuje nie tylko walory smakowe, ale dostarcza organizmowi bogactwa składników odżywczych i witamin.}\n    \n\nnaturalne źródło magnezu, potasu i witaminy E\nDobra i Polska firma\n\n\n        Mieszanka bakaliowa', '', 'bakalland-mieszanka-studencka-klasyczna-200-g', '', '', '', 'Bakalland Mieszanka studencka klasyczna 200 g', '', '', '', ''),
(184, 1, 1, 'Orzechy ziemne wbrew swojej nazwie nie należą do orzechów. Są gatunkiem należącym do roślin strączkowych. Posiadają wyjątkowe właściwości i wartości odżywcze. Z uwagi na wysoką zawartość białka i wielu składników mineralnych, polecane są osobom prowadzącym aktywny tryb życia. Mniejszą zawartość tłuszczu zawdzięczają procesowi prażenia, a wersja niesolona korzystnie wpływa na układ krążenia.', '', 'orzechy-ziemne-prazone-niesolone-600-g', '', '', '', 'Orzechy ziemne prażone niesolone 600 g', '', '', '', ''),
(185, 1, 1, 'Chrupka, złocista i aromatyczna cebula pokrojona w drobne paski. Idealny dodatek do wielu dań.', '', 'cebula-smazona-200-g', '', '', '', 'Cebula smażona 200 g', '', '', '', ''),
(186, 1, 1, 'Helio\n    \n\n        Nadające się do recyklingu\n    \n\n        Rodzynki sułtańskie.', '', 'helio-rodzynki-sultanskie-100-g', '', '', '', 'Helio Rodzynki sułtańskie 100 g', '', '', '', ''),
(187, 1, 1, 'STIR FRY to mieszanina kiełków fasolli Mung, ciecierzcy i dwóch rodzajów soczewicy. Została skomponowana w taki sposób, aby można ją było przyrządzać i podawać na ciepło. ZDROWIE Kiełki STIR FRY są źródłem dużych ilości łatwo przyswajalnego białka. Mieszanka jest również bogata w kwas foliowy oraz żelazo i cynk. Kiełki STIR FRY podsmaża się na oliwie przez kilka minut i doprawia według uznania – na przykład pieprzem, kminkiem lub świeżymi ziołami (tymiankiem, oregano). Można je również dusić z dodatkiem różnych sosów na przykład pomidorowego lub słodko – kwaśnego (do potraw orientalnych). Podsmażone mogą stanowić chrupiący dodatek do makaronów lub sałatek.', '', 'kielki-na-patelnie-stir-fry-200-g', '', '', '', 'Kiełki na patelnię  "STIR FRY" 200 g', '', '', '', ''),
(188, 1, 1, 'Bakalland\n    \n\n        Ziarna słonecznika stanowią doskonałą, wartościową przekąskę, mającą liczne wartości odżywcze. Są również idealnym składnikiem urozmaicającym smak sałatek - zarówno owocowych, jak i warzywnych.}\n    \n\nnaturalne bogactwo magnezu, żelaza i witaminy B1\nDobra i Polska firma\n\n\n        Ziarno słonecznika łuskane', '', 'bakalland-slonecznik-luskany-500-g', '', '', '', 'Bakalland Słonecznik łuskany 500 g', '', '', '', ''),
(189, 1, 1, 'Helio\n    \n\n        Nadające się do recyklingu\n    \n\n        Orzeszki ziemne smażone bez dodatku soli.', '', 'helio-orzeszki-ziemne-200-g', '', '', '', 'Helio Orzeszki ziemne 200 g', '', '', '', ''),
