(195, 1, 1, 'Jej ziarna są cętkowane, zielono-brązowe, ma krzepki, nieco pieprzny smak.\nTo kolejna z soczewic, której ziarna są zdrowe i tak naprawdę trudno cokolwiek „zepsuć” przygotowując z niej danie. Powinno się jej używać w kuchni przez cały rok, zwłaszcza, że można z niej stworzyć dania: szybkie, łatwe i bez jakichkolwiek wyrzutów w stosunku do siebie, jako że potrawy z niej są zdrowe oraz dietetyczne. \nDoskonała do sałatek, zapiekanek, zup, kremów, farszów, pasztetów, a nawet ciasteczek. Świetnie jej w towarzystwie ryżu oraz grillowanych warzyw. \nNie przegap okazji aby dodać więcej smaku twojej soczewicy, wystarczy dodać do wody, w której gotujemy soczewicę np. połowę cebuli, zgnieciony czosnek, czy też wiązkę ziół.', '', 'florpak-soczewica-zielona-500-g', '', '', '', 'Florpak Soczewica zielona 500 g', '', '', '', ''),
