(210, 1, 1, 'W kolorach od khaki do brązowej, ma łagodny smak. Soczewica ta jest doskonałym źródłem molibdenu, kwasu foliowego, błonnika pokarmowego, miedzi, fosforu i manganu. Dodatkowo to doskonały zasób żelaza, białka, witaminy B1, kwasu pantotenowego, cynku, potasu i witaminy B6. Idealna do sałatek, zapiekanek, zup, różnego rodzaju farszów, pasztetów, a nawet ciasteczek. Świetnie jej w towarzystwie ryżu oraz grillowanych warzyw.', '', 'florpak-soczewica-brazowa-500g', '', '', '', 'Florpak Soczewica brązowa 500g', '', '', '', ''),
