(220, 1, 1, 'Helio\n    \n\n        Daktyle suszone są naturalnym, bogatym źródłem błonnika pokarmowego.W 100 g produktu jest 8 g błonnika.bez konserwantówbogate źródło błonnikadoskonała przekąskanaturalnie dla Ciebienaturalnie wyjątkowy smak}\n    \n\n100% natury\nnaturalnie dla zdrowia\nbez substancji konserwujących\nnaturalnie dla Ciebie\n\n\n        Daktyle suszone bez pestek, odmiany Deglet Nour.', '', 'helio-natura-daktyle-deglet-nour-100-g', '', '', '', 'Helio Natura Daktyle Deglet Nour 100 g', '', '', '', ''),
