(223, 1, 1, 'Kiełki warzywne to jedno z pierwszych stadiów wzrostu rośliny.\nW początkowym okresie kiełkujące nasiona uwalniają bardzo duże ilości łatwo przyswajalnych substancji odżywczych niezwykle cennych dla człowieka.\nTo właśnie bogactwo substancji odżywczych zadecydowało o ich fenomenie.\nStanowią prawdziwy skarbiec witamin, głównie A, C i z grupy B, ale niektóre zawierają także rzadko spotykaną witaminę D.\nW ich składzie można odnaleźć także wiele składników mineralnych – fosfor, potas, żelazo, miedź, cynk, itp.\nStanowią idealne uzupełnienie diety, zwłaszcza w okresie późno wiosennym, gdy dostęp do świeżych warzyw i owoców jest najbardziej ograniczony.\nKiełki brokułu, lucerny, czy fasoli Mung to naturalne suplementy diety, które organizm łatwo przyswaja i pełniej czerpie z ich składników.\nRegularne spożywanie tych produktów przyczynia się do wzmocnienia układu immunologicznego, a także może zmniejszyć znacząco ryzyko występowania wielu schorzeń.\nPonadto są to produkty spożywcze, które idealnie sprawdzają się w roli zdrowej przekąski – spożywanej osobno, jak również w postaci pysznego dodatku do kanapek, zup, sałatek, jak też potraw kuchni z całego świata.', '', 'goh-kielki-soczewicy-150-g', '', '', '', 'GOH Kiełki soczewicy 150 g', '', '', '', ''),
(224, 1, 1, 'Crispy Natural\n    \n\n        Specjalnie dla Ciebie wysuszyliśmy chipsy z jabłka nie dodając tłuszczu, w których zachowaliśmy wysokie wartości odżywcze dzięki innowacyjnej technologii suszenia.}\n    \n\nze świeżych jabłek\nsuszone, bez smażenia i pieczenia\nźródło błonnika pokarmowego\nbez dodatku cukrów*\nprodukt bezglutenowy***\n1 z 5 porcji owoców i warzyw\n* zawiera naturalnie występujące cukry\n*** przebadany przez akredytowane laboratorium\n\n\n        Chipsy z jabłka.', '', 'crispy-natural-chrupsy-suszone-chipsy-z-jablka-z-sokiem-truskawkowym-18-g', '', '', '', 'Crispy Natural Chrupsy Suszone chipsy z jabłka z sokiem truskawkowym 18 g', '', '', '', ''),
(225, 1, 1, 'Bakalland\n    \n\n        Miękka, mięsista skórka i słodki smak to sekret najlepszych moreli Bakalland. Morele to znakomita przekąska dla osób dbających o linię: w 100 gramach znajduje się 301 kalorii, które dostarczają organizmowi ponad 100% dziennej dawki istotnej dla zdrowia witaminy A.}\n    \n\nnaturalne źródło żelaza, wapnia i witaminy A\nDobra i Polska firma\n\n\n        Morele suszone bez pestek', '', 'bakalland-morele-suszone-400-g', '', '', '', 'Bakalland Morele suszone 400 g', '', '', '', ''),
