(229, 1, 1, 'Bakalland\n    \n\n        Orzech kokosowy pod twardą skorupą skrywa wartościowy skarb. Cenny miąższ wykorzystywany jest jako dodatek do ciast i deserów. Bogactwo błonnika sprawia, że wiórki są również wartościową bazą do koktajli i owsianek.Czy wiesz, że:Wiórki kokosowe od Bakalland to produkt w 100 % naturalny.W języku starożytnych Indian palma kokosowa oznacza "drzewo, które zaspokaja wszystkie potrzeby życia".Z jednego orzecha można uzyskać do 75 orzechów kokosowych.}\n    \n\nprodukt 100 % naturalny\nnaturalne źródło żelaza i magnezu\n...prosto z plantacji\nDobra i polska firma\n\n\n        Wiórki kokosowe.', '', 'bakalland-wiorki-kokosowe-100-g', '', '', '', 'Bakalland Wiórki kokosowe 100 g', '', '', '', ''),
