(250, 1, 1, 'Helio\n    \n\n        Nadające się do recyklingu\n    \n\n        Ziarno kukurydzy solone z dodatkiem masła do przygotowania popcornu maślanego w kuchence mikrofalowej.', '', 'helio-popcorn-maslany-do-mikrofalowki-90-g', '', '', '', 'Helio Popcorn maślany do mikrofalówki 90 g', '', '', '', ''),
(251, 1, 1, 'Crispy Natural\n    \n\n        W trosce o CiebieFoliany pomagają w prawidłowym funkcjonowaniu układu odpornościowego oraz przyczyniają się do zmniejszenia uczucia zmęczenia i znużenia.Potas pomaga w prawidłowym funkcjonowaniu mięśni oraz prawidłowym funkcjonowaniu układu nerwowego.}\n    \n\nchrup buraka\nz 2 świeżych buraków\nwysoka zawartość kwasu foliowego\nźródło potasu\nsuszone, bez smażenia i pieczenia\nwysoka zaw. błonnika pokarmowego\nprodukt bezglutenowy***\nbez substancji konserwujących\n1 z 5 porcji warzyw i owoców\n*** przebadany przez akredytowane laboratorium\n\n\n        Chipsy z buraka.', '', 'crispy-natural-suszone-chipsy-z-buraka-o-smaku-winegret-18-g', '', '', '', 'Crispy Natural Suszone chipsy z buraka o smaku winegret 18 g', '', '', '', ''),
(252, 1, 1, 'BackMit\n    \n\n        BackMit Mak mielony produkuje się tylko i wyłącznie z surowców najwyższej jakości. Opakowanie z folii metalizowanej chroni dodatkowo przed światłem gwarantując dłuższy okres przydatności do spożycia. BackMit Mak mielony oszczędza nowoczesnej gospodyni czas i uzupełnia wspaniale jej indywidualne przepisy.}\n    \n\ngotowy do użycia!\ntylko najwyższej jakości, bez dodatków, gotowy do użycia po dodaniu gorącego mleka\n\n\n        Mak niebieski mielony sterylizowany', '', 'backmit-mak-mielony-500-g', '', '', '', 'BackMit Mak mielony 500 g', '', '', '', ''),
(253, 1, 1, 'Carrefour\n    \n\nźródło błonnika pokarmowego\njakość kontrolowana\n\n\n        Daktyle suszone bez pestek, odmiany Deglet Nour.', '', 'carrefour-extra-daktyle-suszone-deglet-nour-180-g', '', '', '', 'Carrefour Extra Daktyle suszone Deglet Nour 180 g', '', '', '', ''),
(254, 1, 1, 'Ziarno kukurydzy do przygotowania popcornu w kuchence mikrofalowej.', '', 'helio-natura-popcorn-light-do-mikrofalowki-80-g', '', '', '', 'Helio Natura Popcorn light do mikrofalówki 80 g', '', '', '', ''),
(255, 1, 1, 'Carrefour\n    \n\nbez dodatku substancji konserwujących\njakość kontrolowana\n\n\n        Produkt otrzymany ze świeżych ziemniaków, obrany, krojony, pakowany próżniowo i pasteryzowany.', '', 'carrefour-targ-swiezosci-ziemniaki-w-talarkach-450-g', '', '', '', 'Carrefour Targ Świeżości Ziemniaki w talarkach 450 g', '', '', '', ''),
(256, 1, 1, 'Bakalland\n    \n\n50 g gratis\nnaturalne źródło żelaza, cynku i witaminy B1\nDobra i polska firma\n\n\n        Ziarno kukurydzy', '', 'bakalland-popcorn-ziarno-do-prazenia-250-g', '', '', '', 'Bakalland Popcorn ziarno do prażenia 250 g', '', '', '', ''),
(257, 1, 1, 'Dynia makaronowa, podobnie jak pozostałe odmiany dyni, znalazła zastosowanie, w kuchni. Świetnie smakuje pieczona, duszona i gotowana. Jednak ze względu na swoją strukturę, najlepiej prezentuje się w postaci warzywnego spaghetti lub zupy.', '', 'dynia-makaronowa-luz', '', '', '', 'Dynia Makaronowa luz', '', '', '', ''),
(258, 1, 1, 'Helio\n    \n\n        Produkt zawiera o 50% mniej cukru niż inne żurawiny suszone firmy Helio.bez konserwantównaturalnie zdrowezawiera 50% mniej cukrunaturalnie wyjątkowy smakwzbogacony błonnikiem roślinnym}\n    \n\n50% mniej cukru\nnaturalnie dla zdrowia\nwzbogacona błonnikiem\npraktyczne zamknięcie\n\n\n        Żurawina suszona z dodatkiem błonnika roślinnego, o obniżonej zawartości cukru.', '', 'helio-natura-zurawina-suszona-120-g', '', '', '', 'Helio Natura Żurawina suszona 120 g', '', '', '', ''),
(259, 1, 1, 'Siemię lniane bogate w wartości odżywcze idealnie urozmaici każdą dietę.', '', 'siemie-lniane-1-kg', '', '', '', 'Siemię lniane 1 kg', '', '', '', ''),
(260, 1, 1, 'Helio\n    \n\n        Mieszanka różnych orzechów i rodzynek.', '', 'helio-mieszanka-studencka-300-g', '', '', '', 'Helio Mieszanka studencka 300 g', '', '', '', ''),
(261, 1, 1, 'Helio\n    \n\n        Nadające się do recyklingu\n    \n\n        Orzechy pistacjowe prażone i solone w skorupkach', '', 'helio-orzechy-pistacjowe-80-g', '', '', '', 'Helio Orzechy pistacjowe 80 g', '', '', '', ''),
(262, 1, 1, 'Bakalland\n    \n\n        Wystarczy tylko chwila, by sięgnąć po małe przyjemności. Wcześniej jednak długo i starannie wyszukujemy najdoskonalsze owoce, orzechy i ziarna wybierając je z najlepszych zbiorów na świecie. Dzięki temu Bakalland od lat słynie z jakości, a Ty możesz rozkoszować się prawdziwym bogactwem naturalnych smaków!}\n    \n\nchrupiąca przyjemność\nnaturalne bogactwo błonnika pokarmowego\nDobra i polska firma\n\n\n        Kukurydza (popcorn) solona do przygotowania w kuchence mikrofalowej.', '', 'bakalland-popcorn-solony-90-g', '', '', '', 'Bakalland Popcorn solony 90 g', '', '', '', ''),
(263, 1, 1, 'Bakalland\n    \n\n        Sałatki są proste w przygotowaniu, smaczne oraz stanowią skarbnicę cennych wartości odżywczych. Prażone w piecu ziarna słonecznika i dyni z domieszką orzeszków pinii od Bakalland sprawią, że Twoja sałatka będzie jeszcze smaczniejsza i pożywniejsza.Świeże i kolorowe warzywa, takie jak lubisz najbardziej, lekko skropione oliwą i sokiem z cytryny wraz z chrupiącym dodatkiem wprawią w zachwyt najbardziej wymagających smakoszy.}\n    \n\nDobra i polska firma\n\n\n        Mieszanka łuskanych, prażonych ziaren z orzechami pinii.', '', 'bakalland-chrupiaca-salatka-mix-z-ziarnami-prazonymi-slonecznik-dynia-pinia-100-g', '', '', '', 'Bakalland Chrupiąca sałatka mix z ziarnami prażonymi słonecznik dynia pinia 100 g', '', '', '', ''),
(264, 1, 1, 'Małe jagody o czerwonej barwie, odpowiednio wyselekcjonowane. Pochodzą z rejonu północnych Chin i są nazywane "czerwonymi diamentami". Bez substancji konserwujących.', '', 'jagody-goji-suszone-bio-150-g', '', '', '', 'Jagody Goji suszone BIO 150 g', '', '', '', ''),
(265, 1, 1, 'Fasola jest doskonała do zup (np. barszcz czerwony z fasolą), sałatek (np. sałatka jarzynowa z fasolą) i potraw mięsnych. Jest również częstym składnikiem wykorzystywanym w kuchni wegetariańskiej.', '', 'vitalpol-fasola-czerwona-450-g', '', '', '', 'VitalPol Fasola czerwona 450 g', '', '', '', ''),
(266, 1, 1, 'Fasola Piękny Jaś karłowy jest doskonała jako samodzielne danie lub jako dodatek do zup, mięs i sałatek.', '', 'vitalpol-fasola-piekny-jas-karlowy-400-g', '', '', '', 'VitalPol Fasola Piękny Jaś karłowy 400 g', '', '', '', ''),
(267, 1, 1, 'Produkt tradycyjny bez konserwantów. Idealny do zup, sosów, pierogów.', '', 'podgrzybek-brunatny-suszony-krojony-25-g', '', '', '', 'Podgrzybek brunatny suszony krojony 25 g', '', '', '', ''),
(268, 1, 1, 'Crispy Natural\n    \n\n        Specjalnie dla Ciebie wysuszyliśmy chipsy z jabłka nie dodając tłuszczu, w których zachowaliśmy wysokie wartości odżywcze dzięki innowacyjnej technologii suszenia.}\n    \n\nze świeżych jabłek\nsuszone, bez smażenia i pieczenia\nwysoka zaw. błonnika pokarmowego\nbez dodatku cukrów*\nprodukt bezglutenowy***\n1 z 5 porcji owoców i warzyw\n* zawiera naturalnie występujące cukry\n*** przebadany przez akredytowane laboratorium', '', 'crispy-natural-chrupsy-suszone-chipsy-z-jablka-z-sokiem-z-mango-18-g', '', '', '', 'Crispy Natural Chrupsy Suszone chipsy z jabłka z sokiem z mango 18 g', '', '', '', ''),
(269, 1, 1, 'ORZECHY laskowe łuskane BIO 100 %. Produkt może zawierać: SEZAM, SELER, ORZESZKI ARACHIDOWE I INNE ORZECHY.\n\nOznakowanie alergenów: wielkimi literami', '', 'orzechy-laskowe-bio-150-g', '', '', '', 'Orzechy laskowe BIO 150 g', '', '', '', ''),
(270, 1, 1, 'Soczewica jest doskonała do zup, sałatek, czy różnego rodzaju past i farszów.', '', 'vitalpol-soczewica-zielona-450-g', '', '', '', 'VitalPol Soczewica zielona 450 g', '', '', '', ''),
(271, 1, 1, 'Podobnie jak inne rośliny strączkowe ceniona jest ze względu na wysoką zawartość białka. Warto też zwrócić uwagę, iż jako jedna z nielicznych warzyw fasola czarna zawiera selen, który odgrywa ważną rolę w funkcjonowaniu enzymów wątroby i pomaga w detoksykacji niektórych związków rakotwórczych w organizmie.', '', 'florpak-fasola-kolorowa-czarna-500-g', '', '', '', 'Florpak Fasola kolorowa czarna 500 g', '', '', '', ''),
(272, 1, 1, 'Bogata mieszanka suszonych owoców i orzechów stanowi pożywną i smaczną przekąskę. Połączenie chrupkich składników z delikatnymi owocami stanowi doskonały układ, który zadowoli każde podniebienie.', '', 'mieszanka-studencka-100g', '', '', '', 'Mieszanka studencka 100g', '', '', '', ''),
(273, 1, 1, 'Pomidory są bogate w witaminę C i potas. Wzmacniają organizm, regulują ciśnienie krwi. \nW kuchni używane są do sosów, gulaszów, do zup, marynat. Nadają potrawom wyjątkowego aromatu i smaku.', '', 'florpak-pomidor-suszony-150-g', '', '', '', 'Florpak Pomidor suszony 150 g', '', '', '', ''),
(274, 1, 1, '15 g zastępuje 3 pęczki świeżej natki.Pietruszka to aromatyczne ziele o słodko-cierpkim smaku. Jest wartościową i popularną przyprawą. Sprawdzi się jako dodatek do zup, sałatek, serów, jaj i mięs.}\n    \n\nwysuszone z 3 pęczków natki\nz polskiej kuchni\n\n\n        Pietruszka suszona', '', 'pietruszka-suszona-15-g', '', '', '', 'Pietruszka suszona 15 g', '', '', '', ''),
