(276, 1, 1, 'groch żółty 100%.\nOznakowanie alergenów: wielkimi literami', '', 'florpak-groch-zolty-polowki-500-g', '', '', '', 'Florpak - Groch zółty połówki 500 g', '', '', '', ''),
(277, 1, 1, 'Helio\n    \n\n        Pestki dyni bez łupinki.', '', 'helio-pestki-dyni-300-g', '', '', '', 'Helio Pestki dyni 300 g', '', '', '', ''),
(278, 1, 1, 'Bez dodatku substancji konserwujących. Idealny na grilla czy piekarnika. Produkt Polski', '', 'ziemniaczki-ugotowane-w-mundurkach-jakosc-z-natury-400-g', '', '', '', 'Ziemniaczki ugotowane w mundurkach "Jakość z Natury" 400 g', '', '', '', ''),
(279, 1, 1, 'Bakalland\n    \n\n        Wystarczy tylko chwila, by sięgnąć po małe przyjemności. Wcześniej jednak długo i starannie wyszukujemy najdoskonalsze owoce, orzechy i ziarna wybierając je z najlepszych zbiorów na świecie. Dzięki temu Bakalland od lat słynie z jakości, a Ty możesz rozkoszować się prawdziwym bogactwem naturalnych smaków!}\n    \n\nchrupiąca przyjemność\nnaturalne bogactwo błonnika pokarmowego\n\n\n        Kukurydza (popcorn) maślana do przygotowania w kuchence mikrofalowej.', '', 'bakalland-popcorn-maslany-90-g', '', '', '', 'Bakalland Popcorn maślany 90 g', '', '', '', ''),
(280, 1, 1, '20 g zastępuje 3 pęczki świeżego koperku.Koperek to jedno z najstarszych ziół o intensywnym smaku i aromacie.Jest doskonałym dodatkiem do zup, sałatek, serów, jaj, ziemniaków i ryb.}\n    \n\nwysuszone z 3 pęczków koperku\nz polskiej kuchni\nPolska Jakość 2012\n\n\n        Koperek suszony', '', 'koperek-suszony-20-g', '', '', '', 'Koperek suszony 20 g', '', '', '', ''),
