(282, 1, 1, 'Helio\n    \n\n        Klasa l}\n    \n\nnajwyższej jakości\n\n\n        Mak niebieski.', '', 'helio-mak-250-g', '', '', '', 'Helio Mak 250 g', '', '', '', ''),
(283, 1, 1, 'Helio\n    \n\n        Nadające się do recyklingu\n    \n\n        Rodzynki Thompson Jumbo.', '', 'helio-rodzynki-krolowej-150-g', '', '', '', 'Helio Rodzynki królowej 150 g', '', '', '', ''),
(284, 1, 1, 'Crispy Natural\n    \n\n        Czy wiesz, że... tę poręczną paczkę suszonych chipsów zrobiliśmy dla ciebie, aż ze... 150 g ananasa!Chrupiące chipsy z ananasa to idealny pomysł na 1 z 5 porcji owoców i warzyw! które warto spożywać każdego dnia, dbając o swój organizm oraz dobre samopoczucie.Przekąska on the go! Chrup jak lubisz.W pracy. W szkole, W domu. Na wycieczce. Po treningu.}\n    \n\nchrup ananasa\n100% ananasa!\nwysoka zawartość witaminy C\nwysoka zawartość manganu\nodpowiedni dla vegan\nprodukt bezglutenowy\nbez dodatku cukrów*\nsuszone! bez smażenia &amp; pieczenia\n* Zawiera naturalnie występujące cukry', '', 'crispy-natural-suszone-chipsy-z-ananasa-15-g', '', '', '', 'Crispy Natural Suszone chipsy z ananasa 15 g', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(285, 1, 1, 'Bogata w białko, witaminy (A, B, E, PP), minerały (wapń, magnez, potas, fosfor, żelazo) oraz lecytynę. To doskonały składnik zup, dań jednogarnkowych, sałatek, past, tradycyjnej „fasolki po bretońsku”. Idealnymi ziołami współgrającymi z tą fasolą są: majeranek, kminek, tymianek, które pobudzają procesy trawienne.', '', 'florpak-fasola-piekny-jas-450-g', '', '', '', 'Florpak Fasola Piękny Jaś 450 g', '', '', '', ''),
(286, 1, 1, 'Mieszanka warzyw, drobno krojonych, którą cechuje aromatyczny smak i zapach. Produkt polski, bez konserwantów.', '', 'warzywa-suszone-500-g', '', '', '', 'Warzywa suszone 500 g', '', '', '', ''),
(287, 1, 1, 'Helio\n    \n\n        Migdały są naturalnym, bogatym źródłem błonnika pokarmowego. W 100 g produktu jest 13 g błonnika.bez konserwantówdoskonała przekąskanaturalnie dla Ciebiebogate źródło błonnikanaturalnie wyjątkowy smak}\n    \n\n100% natury\nnaturalnie dla zdrowia\nbez dodatku soli i tłuszczu\n\n\n        Migdały łuskane, prażone', '', 'helio-natura-migdaly-pieczone-100-g', '', '', '', 'Helio Natura Migdały pieczone 100 g', '', '', '', ''),
(288, 1, 1, 'Bakalland\n    \n\n        Czy wiesz, że...* Zbiory winogron rozpoczynają się pod koniec sierpnia oraz w pierwszej połowie września - gdy kiście są już bardzo dojrzale i soczyste.* Najlepsze rodzynki to cale, jędrne owoce o jednolitym kształcie i kolorze oraz zbliżonej wielkości.* Do suszenia wykorzystywane są specjalne gatunki winogron - najczęściej bezpestkowe.}\n    \n\nźródło błonnika pokarmowego i żelaza\ndobra i polska firma\n\n\n        Rodzynki sułtańskie.', '', 'bakalland-rodzynki-sultanskie-200-g', '', '', '', 'Bakalland Rodzynki sułtańskie 200 g', '', '', '', ''),
(289, 1, 1, 'Bogaty skład powoduje, że mieszanka MAKAR BAKALIE stanowi pożywną i smaczną przekąskę.', '', 'mieszanka-zurawinowo-orzechowa-500-g', '', '', '', 'Mieszanka żurawinowo - orzechowa 500 g', '', '', '', ''),
(290, 1, 1, 'Bakalland\n    \n\n        Migdały łuskane są źródłem magnezu i wapnia. Magnez przyczynia się do zmniejszenia uczucia zmęczenia i znużenia, utrzymania prawidłowego metabolizmu energetycznego oraz pomaga w prawidłowym funkcjonowaniu układu nerwowego i mięśni. Wapń jest potrzebny do utrzymania zdrowych kości i zębów.Korzystne działanie występuje w przypadku spożywania 2 porcji dziennie. Pamiętaj, że zrównoważona dieta i aktywny tryb życia są ważne dla zachowania dobrego samopoczucia i zdrowia.Czy wiesz, że...- Mielone migdały to główny składnik marcepanu.- Największymi producentami migdałów są Stany Zjednoczone i Hiszpania.- Migdały należą do rodziny różowatych, tak samo jak morele, brzoskwinie i czereśnie.}\n    \n\nźródło magnezu i wapnia\nDobra i polska firma\n\n\n        Migdały łuskane.', '', 'bakalland-migdaly-100-g', '', '', '', 'Bakalland Migdały 100 g', '', '', '', ''),
(291, 1, 1, 'Helio\n    \n\n        miękkie soczyste owocebez substancji konserwującychwysoka zawartość błonnikanaturalnie ciemny kolorCiemny kolor owoców wynika z naturalnego procesu suszenia bez użycia substancji konserwujących. Morele suszone są naturalnym, bogatym źródłem błonnika pokarmowego. 100 g produktu zawiera 7,1 g błonnika.}\n    \n\nsuszone miękkie owoce\nbez konserwantów\n\n\n        Suszone morele bez pestek, częściowo uwodnione, pasteryzowane.', '', 'helio-natura-so-soft-morele-150-g', '', '', '', 'Helio Natura So Soft! Morele 150 g', '', '', '', ''),
