(293, 1, 1, 'ORZESZKI ziemne blanszowane 98,3%, olej rzepakowy 1,0%, sól 0,7%. Produkt może zawierać: ORZECHY, NASIONA SEZAMU, SOJĘ, MLEKO, JAJA, DWUTLENEK SIARKI.\nOznakowanie alergenów: wielkimi literami', '', 'orzechy-ziemne-smazone-solone-600-g', '', '', '', 'Orzechy ziemne smażone solone 600 g', '', '', '', ''),
