(295, 1, 1, 'Bakalland\n    \n\n        Orzechy pinii są źródłem cynku i magnezu. Cynk pomaga w prawidłowym funkcjonowaniu układu odpornościowego i w utrzymaniu prawidłowych funkcji poznawczych, a magnez przyczynia się do zmniejszenia uczucia zmęczenia i znużenia oraz pomaga w prawidłowym funkcjonowaniu układu nerwowego.Korzystne działanie występuje w przypadku spożycia 2 porcji dziennie. Pamiętaj, że zrównoważona dieta i aktywny styl życia są bardzo ważne dla zachowania dobrego samopoczucia i zdrowia.Czy wiesz, że...- W starożytnym Rzymie oraz Grecji orzechy pinii wykorzystywane były do produkcji marcepanu.- Pinia jest obowiązkowym elementem Pesto alla genovese, pochodzącego z włoskiej Ligurii.- Delikatne podprażenie pinii na suchej patelni pozwala na wydobycie pełni aromatu.}\n    \n\nźródło cynku i magnezu\n\n\n        Orzechy pinii.', '', 'bakalland-orzechy-pinii-75-g', '', '', '', 'Bakalland Orzechy pinii 75 g', '', '', '', ''),
(296, 1, 1, '- Wysoka zawartość błonnika pokarmowego.', '', 'wiorki-kokosowe-400-g', '', '', '', 'Wiórki kokosowe 400 g', '', '', '', ''),
