(298, 1, 1, 'BackMit\n    \n\n        Tylko najwyższej jakości! Bez dodatków! Gotowy do użycia!BackMit Migdały tarte produkuje się z surowców najwyższej jakości. Migdały są raz do roku zbierane, a następnie odpowiednio składowane. W trakcie jednego cyklu produkcyjnego surowiec jest tarty i natychmiast pakowany.Opakowanie z folii metalizowanej chroni dodatkowo przed światłem, gwarantując dłuższy okres przydatności do spożycia. BackMit Migdały tarte oszczędzają czas nowoczesnej gospodyni i pasują wspaniale do każdego indywidualnego przepisu.CechyMigdały tarte najwyższej jakości, bez dodatków, świeżo tarte, gotowe do użycia.Migdały tarte BackMit - nasz nowy Hit sprzedaży są idealne dla nowoczesnych gospodarstw domowych. Gotowe do użycia zaoszczędzą cenny czas oraz dają możliwość tworzenia najróżniejszych wypieków, bazując na prostych lub bardzo kreatywnych przepisach. }', '', 'backmit-tarte-migdaly-200-g', '', '', '', 'BackMit Tarte migdały 200 g', '', '', '', ''),
(299, 1, 1, 'Bakalland\n    \n\n        Pestki dyni są naturalnym źródłem cynku. Cynk pomaga w prawidłowej syntezie białka i funkcjonowaniu układu odpornościowego. Pomaga także zachować zdrowe włosy, skórę i paznokcie.Korzystne działanie występuje w przypadku spożywania 1 porcji dziennie.Pamięta, że zrównoważona dieta i aktywny tryb życia są ważne dla zachowania dobrego samopoczucia i zdrowia.Czy wiesz, że...* Wysoką klasę pestek dyni najłatwiej rozpoznać po ich kolorze - te najlepsze mają wyraźną zieloną barwę oraz niewielką ilość zanieczyszczeń. * Prażenie pestek na patelni uwalnia pełnię aromatu oraz dodaje chrupkości. * Z pestek dyni wytłacza się olej, który jest zarówno produktem spożywczym, jaki kosmetycznym.}\n    \n\nźródło cynku i wysoka zawartość białka\nDobra i polska firma\n\n\n        Pestki dyni.', '', 'bakalland-pestki-dyni-200-g', '', '', '', 'Bakalland Pestki dyni 200 g', '', '', '', ''),
