(303, 1, 1, 'Bakalland\n    \n\n        Orzechy włoskie odznaczają się wysoką zawartością kwasów tłuszczowych omega-3. 100 g orzechów włoskich zawiera 9,3 g kwasu alfa-linolenowego. Kwas alfa-linolenowy pomaga w utrzymaniu prawidłowego poziomu cholesterolu we krwi.Korzystne działanie występuje w przypadku spożywania 2 g kwasu alfa-linolenowego dziennie (czyli ok. 1 porcji orzechów).Pamiętaj, że zrównoważona dieta i aktywny styl życia są bardzo ważne dla zachowania dobrego samopoczucia i zdrowia.Czy wiesz, że...- Orzechom włoskim ze względu na ich kształt przypominający ludzki mózg od wieków przypisuje się niezwykle działanie. I słusznie, ponieważ są świetnym źródłem kwasów omega-3!- Nazwa „orzech włoski" wywodzi się od Wołoszczyzny - historycznej krainy na obszarze Rumunii skąd te przekąski trafiły do naszego kraju.- Najwyższej jakości orzechy włoskie to dorodne połówki z jednolitą barwą skórki.}\n    \n\nwysoka zawartość kwasów tłuszczowych omega-3\n30 g gratis\n\n\n        Orzechy włoskie łuskane.', '', 'bakalland-orzechy-wloskie-230-g', '', '', '', 'Bakalland Orzechy włoskie 230 g', '', '', '', ''),
(304, 1, 1, 'Crispy Natural\n    \n\n        Suszenie ma znaczenie!Powstałe z pasji i doświadczeniaWysokiej jakości gruszki od lokalnych, sprawdzonych dostawców starannie wysuszyliśmy w naszej innowacyjnej technologii, zachowując wysokie wartości odżywcze.Wszystko to bez dodatku grama tłuszczu, czy cukru. Spróbuj!Chrupiące Chipsy z GruszkiTo idealny pomysł na 1 z 5 porcji owoców i warzyw! które warto spożywać każdego dnia, dbając o swój organizm oraz dobre samopoczucie.Przekąska on the go! Chrup jak lubisz.W pracy. W szkole. W domu. Na wycieczce. Po treningu.Czy wiesz, żetę poręczną paczkę suszonych chipsów zrobiliśmy dla Ciebie, aż ze... 160 g świeżych gruszek!}\n    \n\nze świeżych gruszek!\nodpowiedni dla vegan\nźródło błonnika pokarmowego\nprodukt bezglutenowy\nbez dodatku cukrów*\nsuszone! bez smażenia &amp; pieczenia\n*Zawiera naturalnie występujące cukry', '', 'crispy-natural-suszone-chipsy-z-gruszki-18-g', '', '', '', 'Crispy Natural Suszone chipsy z gruszki 18 g', '', '', '', ''),
