(308, 1, 1, 'Orzechy ziemne naturalne są trudno dostępnym produktem w Polsce, a spożywanie ich na surowo nie jest jeszcze tak popularne\n jak w innych krajach. Orzechom ziemnym naturalnym w smaku bliżej do roślin strączkowych aniżeli do orzechów. Orzeszki te na długo zaspokajają głód, więc można jeść je same czy też dodawać do różnego rodzaju potraw, co chętnie czynią mieszkańcy Azji. Nie są poddawane obróbce termicznej, która wpływa na ich walory smakowe oraz zdrowotne.', '', 'orzeszki-ziemne-bez-lupiny-naturalne-1-kg', '', '', '', 'Orzeszki ziemne bez łupiny naturalne 1 kg', '', '', '', ''),
