(319, 1, 1, 'Korzyści zdrowotne tej fasoli są dość imponujące, zawiera ona mnóstwo potasu, magnezu, kwasu foliowego, błonnika i witaminy B6. Można wykorzystać ją do zrobienia pysznych zup, użyć zamiennie do cieciorki i przygotować z niej „falafel” – popularne danie kuchni arabskiej, ziarna fasoli Mungo idealnie nadają się do kiełkowania, a kiełki z niej, stanowią źródło białka i cennych witamin. Kiełki  są doskonałym komponentem sałatek, surówek, podawać je można także z ryżem, w zapiekankach, czy też jako dodatek do kanapek.', '', 'florpak-fasola-mungo-500-g', '', '', '', 'Florpak Fasola Mungo 500 g', '', '', '', ''),
