(324, 1, 1, 'Bakalland\n    \n\n        Czy wiesz, że...- Najwyższej jakości migdały to te najdorodniejsze, z gładką, pomarańczowozłotą skórką.- Nerkowiec rośnie na drzewie, nazywanym nanerczem zachodnim, ale jest on niejako doczepiony do owocu tego drzewa, nazywanego potocznie jabłkiem.- Malownicze pejzaże żurawinowych pól rozpościerają się na wschodnim wybrzeżu USA oraz w Kanadzie. W momencie zbiorów pola zalewane są wodą, tworząc rubinowe jeziora pełne owoców.}\n    \n\nźródło błonnika pokarmowego\n\n\n        Mieszanka bakaliowa. Mieszanka orzechów i suszonej słodzonej żurawiny.', '', 'bakalland-mieszanka-bakaliowa-100-g', '', '', '', 'Bakalland Mieszanka bakaliowa 100 g', '', '', '', ''),
(325, 1, 1, 'Bakalland\n    \n\n        Wystarczy tylko chwila, by sięgnąć po małe przyjemności. Wcześniej jednak długo i starannie wyszukujemy najdoskonalsze owoce, orzechy i ziarna wybierając je z najlepszych zbiorów na świecie. Dzięki temu Bakalland od lat słynie z jakości, a Ty możesz rozkoszować się prawdziwym bogactwem naturalnych smaków!}\n    \n\nchrupiąca przyjemność\nnaturalne bogactwo błonnika pokarmowego\nDobra i polska firma\n\n\n        Kukurydza (popcorn) o smaku serowym do przygotowania w kuchence mikrofalowej.', '', 'bakalland-popcorn-o-smaku-serowym-90-g', '', '', '', 'Bakalland Popcorn o smaku serowym 90 g', '', '', '', ''),
(326, 1, 1, 'Cebula jest lekiem na przeziębienie, działa bakteriobójczo. Można ją używać zamiast świeżej cebuli. \nPosiada szerokie właściwości kulinarne, stosowane jest do: pierogów, kopytek, pizzy, zapiekanek, gulaszów oraz zup jarzynowych.', '', 'florpak-cebula-suszona-100-g', '', '', '', 'Florpak Cebula suszona 100 g', '', '', '', ''),
