(335, 1, 1, 'Małe jagody o czerwonej barwie, odpowiednio wyselekcjonowane. Pochodzą z rejonu północnych Chin i są nazywane "czerwonymi diamentami". Bez substancji konserwujących.', '', 'goja-owoce-100g', '', '', '', 'Goja owoce 100g', '', '', '', ''),
(336, 1, 1, 'BackMit\n    \n\n        Tylko najwyższej jakości! Bez dodatków! Gotowy do użycia!BackMit Orzechy włoskie tarte produkuje się z surowców najwyższej jakości. Brak sztucznych dodatków odpowiada za bogaty smak i poruszający zmysły aromat. Opakowanie z folii metalizowanej chroni dodatkowo przed światłem, gwarantując dłuższy okres przydatności do spożycia. BackMit Orzechy włoskie tarte oszczędzają czas nowoczesnej gospodyni i pasują wspaniale do każdego indywidualnego przepisu.CechyOrzechy włoskie tarte najwyższej jakości, bez dodatków, świeżo tarte, gotowe do użycia.Orzechy włoskie tarte BackMit - nasz nowy Hit sprzedaży są idealne dla nowoczesnych gospodarstw domowych. Gotowe do użycia zaoszczędzą cenny czas oraz dają możliwość tworzenia najróżniejszych wypieków, bazując na prostych lub bardzo kreatywnych przepisach.Orzechy włoskie tarte to nieodzowny składnik ciast orzechowych, a także dodatek do innych wypieków, deserów i lodów.}', '', 'backmit-tarte-orzechy-wloskie-200-g', '', '', '', 'BackMit Tarte orzechy włoskie 200 g', '', '', '', ''),
