(351, 1, 1, 'Bakalland\n    \n\n        Mix egzotycznych owoców skomponowanych w odpowiednich proporcach, aby nadać słodyczy domowym wypiekom. Różnorodność barw sprawi, że wypiek będzie wyglądał smakowicie.}\n    \n\nnaturalne źródło błonnika pokarmowego\nDobra i Polska firma\n\n\n        Mieszanka suszonych owoców', '', 'bakalland-mieszanka-keksowa-400-g', '', '', '', 'Bakalland Mieszanka keksowa 400 g', '', '', '', ''),
(352, 1, 1, 'Helio\n    \n\n        Orzechy pistacjowe są naturalnym, bogatym źródłem błonnika pokarmowego. W 100 g produktu jest 6,1 g błonnika.Produkt ma niską zawartość soli. Ograniczenie spożywania soli pomaga w utrzymaniu prawidłowego ciśnienia krwi.Pistacje prażonebogate źródło błonnikanaturalnie dla Ciebienaturalnie wyjątkowy smakbez solibez dodatków}\n    \n\npraktyczne zamkniecie\n100 % natury\nnaturalnie dla zdrowia\nbez dodatku soli\n\n\n        Pistacje prażone w skorupkach.', '', 'helio-natura-pistacje-prazone-90-g', '', '', '', 'Helio Natura Pistacje prażone 90 g', '', '', '', ''),
(353, 1, 1, 'KRESTO\n    \n\n        Truskawka w plastrach 100 % owoculiofilizowana*.- Chrupiące i pożywne owoce- Wysoka zawartość składników odżywczych dzięki procesowi liofilizacji- Intensywny smak i aromat- Produkt bezglutenowy- Bez dodatku cukru*Liofilizacja jest procesem polegającym na usuwaniu wody z uprzednio zamrożonego produktu żywnościowego. Metoda ta pozwala na długotrwałe przechowywanie żywności bez użycia środków konserwujących. Charakteryzuje się wysokim zachowaniem smaku, aromatu i wartości odżywczych - wyższym niż w przypadku klasycznego suszenia.}\n    \n\nprodukt bezglutenowy\notwórz i jedz!\nużyj jako dodatek do jogurtów, deserów, ciast czy napojów\nwysoka zawartość błonnika pokarmowego', '', 'kresto-truskawka-15-g', '', '', '', 'KRESTO Truskawka 15 g', '', '', '', ''),
(354, 1, 1, 'Papryczki ostre to niezbędny składnik pikantnej kuchni, a potrawy nimi przyprawione często znacznie zyskują na smaku i są dużo bardziej wyraziste. Papryczki ostre stosujemy w kuchni meksykańskiej oraz tajskiej, a także jako dodatek do gulaszu, sosów, dań rybnych, potraw warzywnych czy leczo. ', '', 'papryka-ostra-zielona-wazona', '', '', '', 'Papryka ostra zielona ważona', '', '', '', ''),
(355, 1, 1, 'pietruszka suszona 100%. Produkt może zawierać: PSZENICĘ, KASZĘ JĘCZMIENNĄ, SOJĘ, MIGDAŁY, ORZECHY ZIEMNE I WŁOSKIE.\nOznakowanie alergenów: wielkimi literami', '', 'florpak-pietruszka-suszona-100-g', '', '', '', 'Florpak Pietruszka suszona 100 g', '', '', '', ''),
(356, 1, 1, 'KRESTO\n    \n\n        Chipsy jabłkowe są źródłem potasu i witaminy B6. Potas pomaga w utrzymaniu prawidłowego ciśnienia krwi oraz w prawidłowym funkcjonowaniu układu nerwowego. Witamina B6 pomaga w prawidłowej produkcji czerwonych krwinek oraz w prawidłowym funkcjonowaniu układu odpornościowego}\n    \n\nProdukt polski\nbez dodatku cukrów*\nbez dodatku substancji konserwujących\nźródło potasu\nźródło witaminy B6\nwysoka zawartość błonnika pokarmowego\n*zawiera tylko naturalnie występujące cukry\n\n\n        Suszone chipsy z jabłka.', '', 'kresto-chipsy-jablkowe-ze-swiezych-jablek-40-g', '', '', '', 'KRESTO Chipsy jabłkowe ze świeżych jabłek 40 g', '', '', '', ''),
(357, 1, 1, 'Bakalland\n    \n\n        Czy wiesz, że...- Największy wkład w promocję śliwek mieli Europejczycy - to właśnie dzięki nim specjalne gatunki nadające się do suszenia dotarły za ocean, skąd pochodzą najsmaczniejsze owoce.- Odpowiednie nasłonecznienie oraz długi i ciepły okres wegetacji panujący u wybrzeży obu Ameryk sprawia, że śliwki zachowują swoją naturalna słodycz i nasyconą, charakterystyczną barwę - nawet po wysuszeniu.- Sposób drylowania śliwki odgrywa bardzo istotną rolę w zachowaniu jakości i soczystości suszonych owoców. W owocach wysokiej jakości pestka usuwana jest wyłącznie poprzez jedno nakłucie, co pozwala zachować cenny miąższ, jędrność śliwki i pełnię wartości odżywczych.}\n    \n\nźródło błonnika pokarmowego\nDobra i polska firma\n\n\n        Śliwki suszone bez pestek.', '', 'bakalland-sliwki-cale-owoce-100-g', '', '', '', 'Bakalland Śliwki całe owoce 100 g', '', '', '', ''),
