(364, 1, 1, 'Bakalland\n    \n\n        Prażone solone orzechy nerkowca to źródło miedzi i manganu. Miedź pomaga w prawidłowym funkcjonowaniu układu odpornościowego i nerwowego, a mangan przyczynia się do utrzymania prawidłowego metabolizmu energetycznego.Korzystne działanie występuje w przypadku spożywania 1 porcji dziennie. Pamiętaj, że zrównoważona dieta i aktywny styl życia są bardzo ważne dla zachowania dobrego samopoczucia i zdrowia.Czy wiesz, że...- Orzechy nerkowca są bliskimi krewnymi mango i pistacji.- Nerkowce skrywają się w mięsistych, czerwonych owocach, tak zwanych jabłkach nanerczowych.- Otwarte orzechy najlepiej przechowywać w lodówce.}\n    \n\nprażone w piecu bez dodatku tłuszczu\nźródło miedzi i manganu\n\n\n        Orzechy nerkowca prażone z solą.', '', 'bakalland-nerkowce-lekko-solone-70-g', '', '', '', 'Bakalland Nerkowce lekko solone 70 g', '', '', '', ''),
