(369, 1, 1, 'Marchew ma szerokie zastosowanie w kuchni, kosmetyce, ma bogaty zakres właściwości zdrowotnych.\nMarchew bogata w beta- karoten wzmacnia odporność, wpływa korzystnie na wzrok, poprawia koloryt skóry i wpływa na jej stan.\n Stosuje się ją już u małych dzieci w zaburzeniach trawiennych. Podaje się ją przy niedożywieniu, niedokrwistości, w stanach zapalnych, w zaburzeniach przemiany materii. W kuchni, marchew to jeden z podstawowych składników jeśli chodzi o zupy, można  zastosować ją  tutaj w postaci marchewki suszonej.', '', 'florpak-marchew-suszona-100-g', '', '', '', 'Florpak Marchew suszona 100 g', '', '', '', ''),
