(374, 1, 1, 'KRESTO\n    \n\n        Orzechy włoskie są źródłem magnezu, który przyczynia się do zmniejszenia uczucia zmęczenia i znużenia oraz pomaga w utrzymaniu zdrowych kości i zębów. Źródło kwasów tłuszczowych omega 3. Kwas alfa-linolenowy (ALA) pomaga w utrzymaniu prawidłowego poziomu cholesterolu we krwi. Korzystne działanie występuje w przypadku spożywania 2 g kwasu alfa-linolenowego dziennie. Pamiętaj, że zrównoważona dieta i aktywny styl życia są bardzo ważne dla zachowania dobrego samopoczucia i zdrowia.}\n    \n\n80 % połówek*\nźródło kwasów omega-3 oraz magnezu\n*Wagowo', '', 'kresto-select-orzechy-wloskie-100-g', '', '', '', 'KRESTO Select Orzechy włoskie 100 g', '', '', '', ''),
