(383, 1, 1, 'Bakalland\n    \n\n        Migdały łuskane są źródłem magnezu i wapnia. Magnez przyczynia się do zmniejszenia uczucia zmęczenia i znużenia, utrzymania prawidłowego metabolizmu energetycznego oraz pomaga w prawidłowym funkcjonowaniu układu nerwowego i mięśni. Wapń jest potrzebny do utrzymania zdrowych kości i zębów.Korzystne działanie występuje w przypadku spożywania 2 porcji dziennie. Pamiętaj, że zrównoważona dieta i aktywny tryb życia są ważne dla zachowania dobrego samopoczucia i zdrowia.Czy wiesz, że...- Mielone migdały to główny składnik marcepanu.- Największymi producentami migdałów są Stany Zjednoczone i Hiszpania.- Migdały należą do rodziny różowatych, tak samo jak morele, brzoskwinie i czereśnie.}\n    \n\n50 g gratis\nźródło magnezu i wapnia\n\n\n        Migdały łuskane.', '', 'bakalland-migdaly-250-g', '', '', '', 'Bakalland Migdały 250 g', '', '', '', ''),
