(385, 1, 1, 'Bakalland\n    \n\n        Migdały blanszowane są źródłem magnezu. Magnez przyczynia się do zmniejszenia uczucia zmęczenia i znużenia, utrzymania prawidłowego metabolizmu energetycznego oraz pomaga w prawidłowym funkcjonowaniu układu nerwowego i mięśni.Korzystne działanie występuje w przypadku spożywania 1 porcji dziennie. Pamiętaj, że zrównoważona dieta i aktywny tryb życia są ważne dla zachowania dobrego samopoczucia i zdrowia.Czy wiesz, że...* Mielone migdały to główny składnik marcepanu.* Największymi producentami migdałów są Stany Zjednoczone i Hiszpania.* Migdały należą do rodziny różowatych, tak samo jak morele, brzoskwinie i czereśnie.}\n    \n\nźródło magnezu\n\n\n        Migdały blanszowane.', '', 'bakalland-migdaly-blanszowane-100-g', '', '', '', 'Bakalland Migdały blanszowane 100 g', '', '', '', ''),
(386, 1, 1, 'KRESTO\n    \n\n        Śliwki są źródłem potasu, który pomaga w prawidłowym funkcjonowaniu układu nerwowego i utrzymaniu prawidłowego ciśnienia krwi. Pamiętaj, że zrównoważona dieta i aktywny styl życia są bardzo ważne dla zachowania dobrego samopoczucia i zdrowia.}\n    \n\nbez konserwantów\nnaturalne źródło błonnika i potasu', '', 'kresto-select-sliwki-suszone-kalifornijskie-150-g', '', '', '', 'KRESTO Select Śliwki suszone kalifornijskie 150 g', '', '', '', ''),
