(388, 1, 1, 'KRESTO\n    \n\n        Źródło witaminy E. Witamina E pomaga w ochronie komórek przed stresem oksydacyjnym. Źródło fosforu. Fosfor pomaga w utrzymaniu zdrowych kości i zębów. Pamiętaj, że zrównoważona dieta i aktywny styl życia są bardzo ważne dla zachowania dobrego samopoczucia i zdrowia.}\n    \n\nNonpareil*\nnaturalne źródło witaminy E i fosforu\n*Migdały odmiany Nonpareil charakteryzują się dużą jednorodnością, lekko wydłużonym kształtem oraz naturalną słodyczą', '', 'kresto-select-migdaly-150-g', '', '', '', 'KRESTO Select Migdały 150 g', '', '', '', ''),
(389, 1, 1, 'KRESTO\n    \n\n        Świadome odżywianie.Studencki kwadrans wystarczy, by rozkręcić dobrą imprezę!Tu słodkie rodzynki szaleją z bananami, a migdały z orzechami tworzą klimat chrupkiego smaku. Mixuj wrażenia i baw się dobrze.}\n    \n\ndla studentów i nie tylko\nrodzynki jumbo, orzechy laskowe, nerkowce, orzechy ziemne, chipsy bananowe, migdały\nzgrana paczka\n\n\n        Mieszanka orzechów i owoców suszonych.', '', 'kresto-mieszanka-studencka-140-g', '', '', '', 'KRESTO Mieszanka studencka 140 g', '', '', '', ''),
(390, 1, 1, 'Carrefour\n    \n\n        Masz w ręku produkt, który w 100% został wyprodukowany z polskich wiśni. Do suszenia została użyta specjalnie wyselekcjonowana odmiana wiśni, która gwarantuje perfekcyjny smak i aromat. Promujemy polskie jedzenie.Wesprzyj Nas!Kolor i smak produktu zależy od gatunku wiśni.}\n    \n\nwysoka zawartość błonnika pokarmowego\nuprawy przyjazne pszczołom\nbez dodatku cukru i substancji konserwujących\nProdukt polski\n\n\n        Suszone wiśnie bez pestek.', '', 'carrefour-targ-swiezosci-wisnie-suszone-70-g', '', '', '', 'Carrefour Targ Świeżości Wiśnie suszone 70 g', '', '', '', ''),
