(396, 1, 1, 'Bakalland\n    \n\n        Czy wiesz, że...- Morelę zaczęto uprawiać w Chinach prawie 4000 lat temu.- Morela należy do rodziny różowatych - tej samej co migdały, jabłka, gruszki, pigwy, śliwki i maliny.- Kwiaty moreli nie przepadają za niskimi temperaturami. Z tego względu największymi producentami moreli są Turcja, Uzbekistan i Iran.}\n    \n\nwysoka zawartość błonnika pokarmowego\n\n\n        Morele suszone bez pestek.', '', 'bakalland-morele-cale-owoce-200-g', '', '', '', 'Bakalland Morele całe owoce 200 g', '', '', '', ''),
