(399, 1, 1, 'Bakalland\n    \n\n        Zapewne masz tradycyjny sprawdzony przepis na pyszny makowiec przekazywany w Twojej rodzinie od pokoleń. Teraz z naszą masą makową będzie on jeszcze łatwiejszy w przygotowaniu. Za Ciebie zmieliliśmy dwukrotnie najwyższej jakości mak, który nadaje naszej masie makowej odpowiedni smak i aksamitną konsystencję. Bogactwo bakalii z pewnością zachwyci każdego - soczyste rodzynki w połączeniu z aromatyczną skórką pomarańczową tworzą doskonałą kompozycję smakową. Masa makowa jest również źródłem wapnia. To wszystko to zapowiedź udanych wypieków. Z naszą masą makową możesz również przyrządzić inne potrawy - makaron z makiem i bakaliami, ciasteczka makowe, czy też paluchy wypiekane z masą makową z ciasta francuskiego.}\n    \n\n        Masa makowa z bakaliami.', '', 'bakalland-masa-makowa-z-bakaliami-850-g', '', '', '', 'Bakalland Masa makowa z bakaliami 850 g', '', '', '', ''),
