(410, 1, 1, 'Berlinki\nSmak Berlinek to zasługa unikalnej receptury.\nWysoka jakość mięsa, sekretna mieszanka naturalnych przypraw, precyzyjny proces parzenia w kontrolowanej temperaturze oraz wędzenie dymem bukowym sprawiają, że Berlinki smakują wyśmienicie i mają delikatną konsystencję.}\n\nlekkie opakowanie tylko 5 gramów plastiku\nunikalna receptura\nwysoka jakość mięsa\nsekretna mieszanka 8 przypraw\ndelikatnie parzone i wędzone\n\nBerlinki classic. Kiełbasa wieprzowa homogenizowana wędzona parzona w osłonce niejadalnej.', '', 'berlinki-parowki-classic-250-g', '', '', '', 'Berlinki Parówki Classic 250 g', '', '', '', ''),
