(413, 1, 1, 'Krakus\n    \n\n        Odpowiednio dobrana mieszanka przypraw oraz odpowiednio dobrane czasy wędzenia i suszenia odpowiadają za wyjątkową aromatyczność i pełnię smaku kiełbasy myśliwskiej.}\n    \n\nwyprodukowano 100 g ze 136 g mięsa\nwędzona w dymie olchowo-bukowym\notwórz kiedy potrzebujesz świeżo zapakowane\n\n\n        Kiełbasa wieprzowa, średnio rozdrobniona, wędzona, parzona, suszona.', '', 'krakus-kielbasa-mysliwska-270-g', '', '', '', 'Krakus Kiełbasa myśliwska 270 g', '', '', '', ''),
