(448, 1, 1, 'BezMięsny\n    \n\n        Bezmięsny Boczek to prawdziwy król wszystkich uczt. Jest dość słony, lekko pomidorowy, bardzo wyrazisty i dymny - po prostu boczkowy, czyli pyszny! Niezwykłą wielowymiarowość swojego smaku zawdzięcza naturalnym źródłom umami: pomidorom, płatkom drożdżowym i sosowi sojowemu. Struktura Bezmięsnego Boczku jest elastyczna, ale nie gumowata.Bezmięsny Boczek możesz dodać na przykład do domowego burgera, tofucznicy czy spaghetti a''la carbonara. Po krótkim smażeniu na odrobinie oleju staje się cudownie chrupiący. Możesz go także piec, dusić, grillować albo jeść na surowo - inwencja jest tu niczym nieograniczona. Pamiętaj, że tak jak wszystkie nasze produkty, Bezmięsny Boczek można mrozić!Produkt odpowiedni dla wegetarian i wegan}\n    \n\nroślinna alternatywa dla mięsa\nwędzony bezmięsny boczek to świetny dodatek do makaronu, pizzy czy ulubionego śniadania\nwysoka zawartość białka i źródło błonnika\nbez cholesterolu\nbez konserwantów i sztucznych barwników\n\n\n        Bezmięsna wędlina o smaku boczku. Produkt roślinny na bazie białka pszennego.', '', 'bezmiesny-bezmiesny-boczek-150-g', '', '', '', 'BezMięsny Bezmięsny boczek 150 g', '', '', '', ''),
