(533, 1, 1, 'Tarczyński\n    \n\n        Dzięki długiemu suszeniu nasze kabanosy Extra uzyskują idealną kruchość, aromat i ten legendarny smak}\n    \n\n155 g mięsa na 100 g produktu\nbez dodatku glutaminianów, barwników, fosforanów\ndługo suszone dla smaku\nmożna przechowywać poza lodówką\nwędzone dymem olchowo-bukowym\nprodukt bezglutenowy\n\n\n        Wyrób wieprzowy, średnio rozdrobniony, wędzony, parzony, suszony.', '', 'tarczynski-kabanosy-wieprzowe-extra-wysuszone-130-g', '', '', '', 'Tarczyński Kabanosy wieprzowe Extra wysuszone 130 g', '', '', '', ''),
(534, 1, 1, 'Tarczyński\nTakie, jak lubisz, ale rośl-inne.\nPoznaj wyrazisty smak i wyjątkową kruchość naszych kabanosów przygotowanych dla Ciebie z roślin.\nWiemy, że świat potrzebuje nowych źródeł białka, dlatego stworzyliśmy kabanosy rośl-inne bez dodatku konserwantów o wysokiej zawartości protein oraz bogate w błonnik.}\n\nwysoka zawartość białka\nźródło witaminy B12 i żelaza\nbez dodatku konserwantów\nbez kęsa mięsa\nbez GMO\nsoja bez GMO, burak, przyprawy\n\nRoślinne kabanosy oryginalne Go! Wyrób roślinny na bazie białka sojowego, wędzony, parzony, suszony.', '', 'tarczynski-roslinne-kabanosy-go-oryginalne-40-g', '', '', '', 'Tarczyński Roślinne kabanosy Go! oryginalne 40 g', '', '', '', ''),
