(537, 1, 1, 'mięśnie szynki wieprzowej 72%, woda, sól, cukier, przyprawy i ich ekstrakty, aromaty, BIAŁKO SOJOWE,, białko wieprzowe, stabilizatory (difosforany, trifosforany, polifosforany), substancje zagęszczające (karagen, mączka chleba świętojańskiego, guma ksantanowa), przeciwutleniacze (askorbinian sodu, izoaskorbinian sodu), wzmacniacz smaku (glutaminian monosodowy), regulator kwasowości (kwas cytrynowy, cytrynian sodu), substancja konserwująca (azotyn sodu), barwnik (karmel). Produkt może zawierać: GLUTEN, BIAŁKA MLEKA Z LAKTOZĄ, SELER, GORCZYCĘ, DWUTLENEK SIARKI.\n\nOznakowanie alergenów: wielkimi literami', '', 'szynka-konserwowa-200g', '', '', '', 'SZYNKA KONSERWOWA 200g', '', '', '', ''),
