(663, 1, 1, 'Golfera', '', 'golfera-kielbaska-primizia-120-g', '', '', '', 'Golfera Kiełbaska primizia 120 g', '', '', '', ''),
(664, 1, 1, 'Duetto to nowa seria, która łączy wędliny i sery Galbani w jednym opakowaniu. Doskonały zestaw do przygotowania szybkiej kanapki. Zaprojektowane z myślą o lunchu, porannych przerwach lub popołudniowych przekąskach.', '', 'mix-formaggio-salame-100g', '', '', '', 'MIX FORMAGGIO SALAME 100g', '', '', '', ''),
(665, 1, 1, 'mięso z karczku wieprzowego, sól morska, dekstroza, maltodekstryna, PRZYPRAWY (ZAWIERAJĄ GORCZYCĘ), cukier, substancja konserwująca: azotyn sodu, 100 g produktu wytworzono ze 125 g mięsa z karczku wieprzowego. Produkt może zawierać: SOJĘ, ZBOŻA ZAWIERAJĄCE GLUTEN, MLEKO ŁĄCZNIE Z LAKTOZĄ, SELER.\nOznakowanie alergenów: wielkimi literami', '', 'karczek-suszony-pl-100-g', '', '', '', 'Karczek suszony pl 100 g', '', '', '', ''),
(666, 1, 1, 'Tarczyński\nTakie, jak lubisz, ale rośl-inne.\nPoznaj wyrazisty smak i wyjątkową kruchość naszych kabanosów przygotowanych dla Ciebie z roślin.\nWiemy, że świat potrzebuje nowych źródeł białka, dlatego stworzyliśmy kabanosy rośl-inne bez dodatku konserwantów o wysokiej zawartości protein oraz bogate w błonnik.}\n\nwysoka zawartość białka\nźródło witaminy B12 i żelaza\nbez dodatku konserwantów\nbez kęsa mięsa\nbez GMO\nsoja bez GMO, burak, przyprawy\n\nRoślinne kabanosy piri-piri Go! Wyrób roślinny na bazie białka sojowego, wędzony, parzony, suszony.', '', 'tarczynski-roslinne-kabanosy-go-piri-piri-40-g', '', '', '', 'Tarczyński Roślinne kabanosy Go! piri-piri 40 g', '', '', '', ''),
(667, 1, 1, 'mięso wieprzowe 77%, woda, SER RADAMER 7,6%, sól, skrobia modyfikowana kukurydziana, BŁONNIK PSZENNY, regulatory kwasowości: cytryniany sodu, octany sodu, wzmacniacz smaku: glutaminian monosodowy, przyprawy, ekstrakty przypraw, aromaty, glukoza, stabilizatory: difosforany, trifosforany, BIAŁKA MLEKA, SER W PROSZKU,, przeciwutleniacz: askorbinian sodu, substancja konserwująca: azotyn sodu. Produkt może zawierać: SOJĘ, JAJA, SELER I GORCZYCĘ.\nOznakowanie alergenów: wielkimi literami', '', 'kielbaski-bekonowo-serowe-190g', '', '', '', 'KIEŁBASKI BEKONOWO-SEROWE 190g', '', '', '', ''),
(668, 1, 1, 'Tarczyński\nTakie, jak lubisz, ale rośl-inne.\nPoznaj wyrazisty smak i wyjątkową kruchość naszych kabanosów przygotowanych dla Ciebie z roślin.\nWiemy, że świat potrzebuje nowych źródeł białka, dlatego stworzyliśmy kabanosy rośl-inne bez dodatku konserwantów o wysokiej zawartości protein oraz bogate w błonnik.}\n\nwysoka zawartość białka\nźródło witaminy B12 i żelaza\nbez dodatku konserwantów\nbez kęsa mięsa\nsoja bez GMO, burak, przyprawy\n\nRoślinne kabanosy Piri-Piri Go! Wyrób roślinny na bazie białka sojowego, wędzony, parzony, suszony, ze słonecznikiem, siemieniem lnianym i nasionami chia.', '', 'tarczynski-roslinne-kabanosy-go-3-ziarna-40-g', '', '', '', 'Tarczyński Roślinne kabanosy Go! 3 ziarna 40 g', '', '', '', ''),
(669, 1, 1, 'Krakus\n    \n\nwieprzowa\nwędzona dymem bukowym\n100 g wyprodukowano ze 131 g mięsa\n\n\n        Kiełbasa wieprzowa grubo rozdrobniona wędzona parzona podsuszana.', '', 'krakus-kielbasa-zywiecka-podsuszana-80-g-2-x-40-g', '', '', '', 'Krakus Kiełbasa żywiecka podsuszana 80 g (2 x 40 g)', '', '', '', ''),
(670, 1, 1, 'Carrefour\n    \n\n        Fuet - Kiełbasa sucha. Produkt poddany procesowi suszenia.', '', 'carrefour-original-kielbasa-sucha-fuet-170-g', '', '', '', 'Carrefour Original Kiełbasa sucha Fuet  170 g', '', '', '', ''),
(671, 1, 1, 'Kiełbasa śląska. Kiełbasa wieprzowo-drobiowa, średnio rozdrobniona, wędzona, parzona.', '', 'pekpol-kielbasa-slaska-650-g', '', '', '', 'Pekpol Kiełbasa śląska 650 g', '', '', '', ''),
(672, 1, 1, 'Carrefour\n    \n\nProdukt hiszpański\n\n\n        Kiełbasa wieprzowa średniorozdrobniona, surowa, dojrzewająca.', '', 'carrefour-extra-fuet-170-g', '', '', '', 'Carrefour Extra Fuet 170 g', '', '', '', ''),
(673, 1, 1, 'Well Well\n    \n\n        Zainspiruj się - wypróbuj:- pożywne śniadanie - na gorąco, tradycyjnie z wody - dodatek do dania jednogarnkowego np. leczo lub gulaszu - przekąskę - w formie hot-doga}\n    \n\n100 % z roślin\nźródło białka\nniska zawartość cukrów\nniska zawartość tłuszczów nasyconych\n\n\n        Kiełbaski śląskie. Produkt roślinny, na bazie białka sojowego i pszennego, pasteryzowany.', '', 'well-well-kielbaski-slaskie-250-g', '', '', '', 'Well Well Kiełbaski śląskie 250 g', '', '', '', ''),
(674, 1, 1, 'Krakus\n    \n\ndojrzewające minimum 18 dni, z dodatkiem białego pieprzu\nwieprzowe\n100 g wyprodukowano ze 127 g mięsa\ndwie wygodne porcje\nbez dodatku glutaminianu monosodowego\n\n\n        Kiełbasa wieprzowa drobno rozdrobniona surowa suszona wędzona dojrzewająca.', '', 'krakus-stile-siciliano-salami-80-g-2-x-40-g', '', '', '', 'Krakus Stile Siciliano Salami 80 g (2 x 40 g)', '', '', '', ''),
(675, 1, 1, 'Carrefour\n    \n\njakość kontrolowana\n\n\n        Mięso wołowe surowe, suszone, dojrzewające w plastrach.', '', 'carrefour-extra-bresaola-100-g', '', '', '', 'Carrefour Extra Bresaola 100 g', '', '', '', ''),
(676, 1, 1, 'Produkt bez dodatku sztucznych konserwantów, glutenu i laktozy. Podawać na zimno z dodatkiem pieczywa lub na ciepło z kaszą, ryżem, ziemniakami.', '', 'miesko-w-sosie-wlasnym-bez-konserwantow-300-g', '', '', '', 'Mięsko w sosie własnym bez konserwantów 300 g', '', '', '', ''),
(677, 1, 1, 'Kiełbasa wieprzowa, średniorozdrobniona, surowa, suszona, dojrzewająca w plastrach. produkt włoski, 100g produktu gotowego otrzymano ze 138g mięsa i tłuszczu wieprzowego.', '', 'salami-milano', '', '', '', 'Salami Milano', '', '', '', ''),
(678, 1, 1, 'Porcja na jedną kanapkę = 25 g, łatwość otwierania poprzez przekręcenie klipsa, różne smaki w paczce, zapobieganie ubytkom produktów.', '', 'paszteciki-mix-250g', '', '', '', 'PASZTECIKI MIX 250g', '', '', '', ''),
(679, 1, 1, 'Duże kawałki peklowanego mięsa wieprzowego którego zawartość stanowi 85%. Otoczone naturalna galaretą. Wyśmienita mięsna przekąska z delikatną nutą naturalnego bukietu ziół. W sam raz do skosztowania z chrupiącym świeżym pieczywem.', '', 'mieso-z-lopatki-w-galarecie-300-g', '', '', '', 'Mięso z łopatki w galarecie 300 g', '', '', '', ''),
(680, 1, 1, 'Produkt nie zawiera dodatku sztucznych konserwantów, glutenu i laktozy. Idealnie nadaje się na kanapki.', '', 'golonka-premium-bez-konserwantow-300-g', '', '', '', 'Golonka premium bez konserwantów 300 g', '', '', '', ''),
(681, 1, 1, 'Olewnik\n    \n\nze 130 g mięsa/100 g produktu\nbez dodatku glutaminiamu monosodowego, fosforanów i barwników\n\n\n        Kiełbasa wieprzowa, grubo rozdrobniona, wędzona, parzona, suszona, w osłonce niejadalnej.', '', 'olewnik-kielbasa-sucha-zywiecka-z-szynki-220-g', '', '', '', 'Olewnik Kiełbasa sucha żywiecka z szynki 220 g', '', '', '', ''),
(682, 1, 1, 'Dolina Dobra\n    \n\nbez konserwantów\nProdukt polski\nz natury smaczne\nwłasne uprawy, pasze i produkty\nchów w zgodzie z dobrymi praktykami\nrolnictwo przyjazne klimatowi\nprodukt bezglutenowy\n\n\n        Kiełbaski 100 % mięsa. Kiełbaski wieprzowe, średnio rozdrobnione, wędzone, parzone bez osłonki.', '', 'dolina-dobra-kielbaski-100-miesa-250-g', '', '', '', 'Dolina Dobra Kiełbaski 100 % mięsa 250 g', '', '', '', ''),
(683, 1, 1, 'Carrefour\n    \n\nbez dodatku glutaminianu i fosforanów\nwyprodukowane bez stosowania GMO\nProdukt polski\n\n\n        Szynka wieprzowa bez kości, wędzona, parzona.', '', 'carrefour-szynka-wedzona-porcje', '', '', '', 'Carrefour Szynka wędzona porcje', '', '', '', ''),
(684, 1, 1, 'Olewnik\n    \n\nze 143 g mięsa 100 g produktu\nsuszona minimum 100 godzin\nźródło białka\nwędzona dla smaku\n\n\n        Kiełbasa wieprzowa, grubo rozdrobniona wędzona, parzona, suszona, w osłonce niejadalnej.', '', 'olewnik-sucha-krakowska-z-szynki-320-g', '', '', '', 'Olewnik Sucha krakowska z szynki 320 g', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(685, 1, 1, 'TARCZYŃSKI\n    \n\n        Dzięki długiemu suszeniu nasze kiełbasy Extra uzyskują idealny smak i aromat}\n    \n\nbez dodatku konserwantów\nbez dodatku: glutaminianów, barwników, fosforanów\nprodukt bezglutenowy\n\n\n         Krakowska sucha z szynki z indykiem. Wyrób wieprzowo-drobiowy, grubo rozdrobniony, wędzony, parzony, suszony.', '', 'tarczynski-krakowska-sucha-z-indykiem-extra-wysuszona-330-g', '', '', '', 'TARCZYŃSKI Krakowska sucha z indykiem Extra wysuszona 330 g', '', '', '', ''),
(686, 1, 1, 'Tarczyński\n    \n\n        Zdaniem wielu najlepsza mięsna przekąska na świecieTak wysuszone, że nie wymagają przechowywania w lodówce! Możesz mieć te pyszne kabanosy zawsze przy sobie.podróż, praca, impreza, wycieczka, szkoła, filmCzy wiesz, że... najwyższej jakości mięso jest źródłem:dobrze przyswajalnego białka, żelaza, witaminy B12}\n    \n\npyszna przekąska\n185 g mięsa na 100 g produktu\nbez dodatku glutaminianów, barwników, fosforanów\nprodukt bezglutenowy\n\n\n        Kabanosy Exclusive z indyka z dodatkiem wieprzowiny. Wyrób drobiowo-wieprzowy, drobno rozdrobniony, wędzony, parzony, suszony.', '', 'tarczynski-kabanosy-exclusive-paluszki-z-indyka-z-wieprzowina-80-g', '', '', '', 'Tarczyński Kabanosy Exclusive paluszki z indyka z wieprzowiną 80 g', '', '', '', ''),
(687, 1, 1, 'Kabanosy doskonale sprawdzają się jako szybki posiłek o każdej porze dnia. Wyprodukowane bez dodatku fosforanów, z kompozycją aromatycznych przypraw, smakują zarówno w podróży, pracy, jak i na biwaku. Poddawane procesowi suszenia stają się kruche, co znacznie ułatwia dzielenie się ulubionym przysmakiem z najbliższymi. Produkt bezglutenowy.', '', 'kabanosy-biesiadne-wieprzowe-115g', '', '', '', 'Kabanosy biesiadne wieprzowe 115g', '', '', '', ''),
(688, 1, 1, 'woda, olej rzepakowy, białko grochu i ziemniaczane 4%, substancje zagęszczające: karagen, guma konjac (zawiera dwutlenek siarki), metyloceluloza, skrobia, mąka lniana, środki barwiące (koncentrat papryki, wyciąg z kozieradki, koncentrat soku buraczanego, olej roślinny), sól, środek aromatyzujący (zawiera wyciąg z drożdży), przyprawy (papryka, pasternak), ekstrakty przypraw, sacharoza, barwnik: tlenki i wodorotlenki żelaza, wyciąg z jęczmienia słodowego, aromaty, regulatory kwasowości: kwas mlekowy, mleczan wapnia, syrop glukozowy, aromat dymu wędzarniczego', '', 'drobimex-veggie-pasterki-w-stylu-salami-80-g', '', '', '', 'Drobimex Veggie Pasterki w stylu salami 80 g', '', '', '', ''),
(689, 1, 1, 'BezMięsny\n    \n\n        Perfekcyjna przekąska dla koneserów pikantnych smaków, poddana tradycyjnym procesom wędzenia i suszenia.Bezmięsne Kabanosy Chilli to fantastyczna propozycja dla wszystkich fanów pikantnych smaków. Tradycyjny proces wędzenia oraz suszenia nadaje im charakteru, a płatki chilli przyjemnej ostrości.Produkt odpowiedni dla wegetarian i wegan}\n    \n\nroślinna alternatywa dla mięsa\nbez cholesterolu\nbez oleju palmowego\nbez konserwantów\n\n\n        Produkt roślinny na bazie białka pszennego i grochowego.', '', 'bezmiesny-bezmiesne-kabanosy-chilli-160-g', '', '', '', 'BezMięsny Bezmięsne kabanosy chilli 160 g', '', '', '', ''),
(690, 1, 1, 'bezglutenowy\n\n\n        Longaniza\nChorizo. Drobnorozdrobniona kielbasa wieprzowa podsuszana z papryką.\nOliwki.', '', 'tapas-longaniza-chorizo-oliwki-120-g-3-x-40-g', '', '', '', 'Tapas Longaniza Chorizo Oliwki 120 g (3 x 40 g)', '', '', '', ''),
(691, 1, 1, 'Carrefour\n    \n\njakość kontrolowana\n\n\n        Salame Brianza ChNP. Kiełbasa wieprzowa, średniorozdrobniona, surowa, dojrzewająca.', '', 'carrefour-extra-salame-brianza-100-g', '', '', '', 'Carrefour Extra Salame Brianza 100 g', '', '', '', ''),
(692, 1, 1, 'Produkt bez dodatku sztucznych konserwantów, glutenu i laktozy. Podawać na zimno z dodatkiem pieczywa lub na ciepło z kaszą, ryżem, ziemniakami.', '', 'kielbasa-schabowa-bez-konserwantow-300-g', '', '', '', 'Kiełbasa schabowa bez konserwantów 300 g', '', '', '', ''),
(693, 1, 1, 'Wyprodukowane z wysokiej jakości mięsa drobiowo-wieprzowego kabanosy, doskonale prezentują się na tacach z wędlinami. Poddawane procesowi wędzenia wyroby są idealnie kruche, co pozwala delektować się ich smakiem w gronie najbliższych. Charakterystyczny smak i aromat produkty zawdzięczają odpowiednio skomponowanej mieszance przypraw oraz specjalnemu procesowi suszenia. Produkt bezglutenowy.', '', 'kabanosy-biesiadne-drobiowe-z-wieprzowina-115g', '', '', '', 'Kabanosy biesiadne drobiowe z wieprzowiną 115g', '', '', '', ''),
(694, 1, 1, 'Elpozo\n    \n\n        Mortadela z oliwkami plastry', '', 'elpozo-mortadela-z-oliwkami-plastry-250-g', '', '', '', 'Elpozo Mortadela z oliwkami plastry 250 g', '', '', '', ''),
(695, 1, 1, 'mięso wieprzowe, sól, glukoza, cukier, przeciwutleniacz (kwas askorbinowy), warzywa suszone, przyprawy (jałowiec 0,15%), ekstrakty przypraw, substancja konserwująca (azotyn sodu), Osłonka jadalna wieprzowa, 100 g wyrobu wyprodukowano z 154 g mięsa wieprzowego\n\nAlergeny: Produkt może zawierać: jaja, soję, białka mleka (z laktozą), orzeszki ziemne, seler, gorczycę, nasiona sezamu.', '', 'duda-specialite-kielbasa-jalowcowa-150-g', '', '', '', 'Duda Spécialité Kiełbasa jałowcowa 150 g', '', '', '', ''),
(696, 1, 1, 'tradycyjna kiełbasa hiszpańska robiona z wieprzowiny. Przysmak ten jest łatwo rozpoznawalny spośród innych specjałów kuchni hiszpańskiej dzięki swojemu mocnemu i charakterystycznemu zapachow', '', 'chorizo-cular', '', '', '', 'Chorizo Cular', '', '', '', ''),
(697, 1, 1, 'Wyśmienity produkt wywodzący się z polskiej i południowo europejskiej tradycji wędliniarskiej. Dzięki specjalnej kompozycji przypraw i procesowi dojrzewania osiąga subtelny smak i zapach.', '', 'sokolow-gold-salami-bretonskie-100-g', '', '', '', 'Sokołów Gold Salami Bretońskie 100 g', '', '', '', ''),
(698, 1, 1, 'Sokołów\n    \n\n        Dla tych, co kochają smak!Extra krucheDo pracyNa imprezęDo filmuDo szkołyNad morzeW góryNa biwakGdziekolwiek chcesz}\n    \n\n185 g mięsa na 100 g produktu\nwysoka zawartość białka\nbez dodatku fosforanów\nprodukt bezglutenowy\n\n\n        Kabanosy wieprzowo-wołowe, drobno rozdrobnione, wędzone, parzone, suszone.', '', 'sokolow-kabanosy-francuskie-100-g', '', '', '', 'Sokołów Kabanosy francuskie 100 g', '', '', '', ''),
(699, 1, 1, '<p>Produkt bez dodatku konserwantów, glutenu i laktozy. Podawać na zimno z dodatkiem pieczywa lub na ciepło z kaszą, ryżem, ziemniakami.</p>', '', 'miesko-z-kurczaka-bez-konserwantow-300-g', '', '', '', 'Mięsko z kurczaka bez konserwantów 300 g', '', '', '', ''),
(700, 1, 1, 'Bez glutaminianu monosodowego, z dodatkiem miodu z Mazur oraz śmietanki z lokalnych mleczarni, co zapewnia doskonałą kremową konsystencję i smak.', '', 'pasztet-delikatesowy-200g', '', '', '', 'PASZTET DELIKATESOWY 200g', '', '', '', ''),
(701, 1, 1, 'Simpl\n    \n\n        Wędzony drewnem bukowym.}', '', 'simpl-boczek-wieprzowy-wedzony-200-g', '', '', '', 'Simpl Boczek wieprzowy wędzony 200 g', '', '', '', ''),
(702, 1, 1, 'Olewnik\n    \n\n        Okazja czyni przekąskę doskonałą! Idealne w podróży, na rower, w pracy i podczas wędrówki.}\n    \n\nrwiesz i jesz!\nze 180 g mięsa/100 g produktu\nciesz się smakiem!\n\n\n        Kabanosy Enjoy ostre. Kiełbasa wieprzowa, drobno rozdrobniona, wędzona, parzona, suszona.', '', 'olewnik-enjoy-kabanosy-ostre-105-g', '', '', '', 'Olewnik Enjoy Kabanosy ostre 105 g', '', '', '', ''),
(703, 1, 1, 'BezMięsny\n    \n\n        Paprykowe Bezmięsne Pepperoni najlepiej smakuje w leczo, na pizzy i jako dodatek do makaronówProdukt odpowiedni dla wegetarian i wegan}\n    \n\nroślinna alternatywa dla mięsa\nwysoka zawartość białka i źródło błonnika\nbez cholesterolu\nbez konserwantów i sztucznych barwników\n\n\n        Bezmięsna wędlina o smaku pepperoni z dodatkiem papryki. Produkt roślinny na bazie białka pszennego.', '', 'bezmiesny-bezmiesne-pepperoni-130-g', '', '', '', 'BezMięsny Bezmięsne pepperoni 130 g', '', '', '', ''),
(704, 1, 1, 'Pekpol\n    \n\nzawartość mięsa 95 %\n\n\n        Kiełbasa wieprzowa średnio rozdrobniona, parzona.', '', 'pekpol-kurpiowskie-specjaly-kielbasa-biala-z-szynki-400-g', '', '', '', 'Pekpol Kurpiowskie specjały Kiełbasa biała z szynki 400 g', '', '', '', '');
